insert  into `info_content`(`id`,`user_id`,`filter_id`,`class_id`,`title_en`,`desc_en`,`title_cn`,`desc_cn`,`detail_en`,`detail_cn`,`publish_by`,`publish_time`,`email`,`phone`,`cell`,`fax`,`address`,`city`,`state`,`memo`,`seo_keyword`,`seo_desc`,`hits`,`reviews`,`orderno`,`status`,`deleted`,`created_time`,`last_updated`) values (0,0,2,7,'','','dfadsf','fasdfa sfas','','dfsadfa sfsdafsda','雪上飞葫',NULL,'bb3343b@bbb.com','604-887-9987','778-988-8989',NULL,'3659 Canada Way','Burnaby',NULL,NULL,'','',0,0,0,1,0,1454373993,0),(1,0,1,7,'dsfasdfd','badsadfsdfsa','sdafsad','adsfasdf asdfasdfdsaf','<div class=\"original-tit\">原标题：&ldquo;军改&rdquo;中&ldquo;脱颖而出&rdquo;的5位陆军少将</div>\n\n<div class=\"text clear\" id=\"contentText\">\n<div>\n<p>　　本稿转自公众号：&ldquo;政事儿&rdquo;(微信ID：gcxxjgzh)</p>\n\n<p>　　年初新华社报道披露了陆军、火箭军、战略支援部队三军司令员和政委，至今，&ldquo;军改&rdquo;中各部军政主官及中央军委职能部门负责人的人事安排情况，陆续由官方报道披露。</p>\n\n<p>　　2015年12月31日，陆军领导机构、火箭军和战略支援部队成立大会举行。</p>\n\n<div><img alt=\"此后，有媒体报道，陆军总部领导层由11位将领组成。除了陆军司令员李作成和陆军政委刘雷之外，还包括兰州军区原副司令员彭勃中将、南京军区原副司令员尤海涛中将、成都军区原参谋长戎贵卿少将、兰州军区原副政委石晓少将、南京军区原副政委兼纪委书记吴刚中将、武警部队原参谋长刘振立少将、北京军区政治部原主任张书国少将、济南军区联勤部原部长韩志庆少将、总装备部陆军装备科研订购部原部长高波少将。\" src=\"http://photocdn.sohu.com/20160120/Img435240992.jpeg\" />\n<div class=\"conserve-photo\" style=\"top: 854px; left: 461px; display: block;\">\n<div class=\"comCount\">0</div>\n</div>\n</div>\n\n<div>\n<p>　　此后，有媒体报道，陆军总部领导层由11位将领组成。除了陆军司令员李作成和陆军政委刘雷之外，还包括兰州军区原副司令员彭勃中将、南京军区原 副司令员尤海涛中将、成都军区原参谋长戎贵卿少将、兰州军区原副政委石晓少将、南京军区原副政委兼纪委书记吴刚中将、武警部队原参谋长刘振立少将、北京军 区政治部原主任张书国少将、济南军区联勤部原部长韩志庆少将、总装备部陆军装备科研订购部原部长高波少将。</p>\n\n<p>　　&ldquo;政事儿&rdquo;(微信ID：gcxxjgzh)梳理发现，在&ldquo;军改&rdquo;中新成立的陆军领导班子中有5位少将较受关注。他们中既有&ldquo;50后&rdquo;，也有&ldquo;60后&rdquo;，有人曾在枪林弹雨中立下赫赫战功，有人具备丰富的政工经历。</p>\n\n<p>　　他们有一个大致的共同点：十八大后，&ldquo;军改&rdquo;前，已完成多次调整，连续晋升。</p>\n</div>\n</div>\n</div>','<div class=\"original-tit\">原标题：【盘点】习近平四次会面埃及高层领导人</div>\n\n<div class=\"text clear\" id=\"contentText\">\n<div>\n<p>　　人民网北京1月20日电中国国家主席习近平将于2016年1月20日至22日对埃及进行国事访问。</p>\n\n<p>　　中埃友谊源远流长，历史上两国人民早就有交往，早在1956年，中埃两国政府就发表联合公报，宣布建立外交关系。</p>\n\n<p>　　2015年12月埃及总统塞西访华期间，中埃两国确定于2016年两国建交60周年之际在埃及举办中国文化年，在中国举办埃及文化年。</p>\n\n<p>　　近年来，中埃两国领导人保持频繁接触，下面本网对十八大以来习近平与埃及高层领导人的历次会谈会面进行盘点。</p>\n\n<p>　　<strong>2015年12月4日</strong></p>\n\n<p>　　<strong>习近平会见埃及总理伊斯梅尔 加快推进共建&ldquo;一带一路&rdquo;框架内合作项目</strong></p>\n\n<div><img alt=\"2015年12月4日，中国国家主席习近平在约翰内斯堡会见埃及总理伊斯梅尔。新华社记者张铎 摄\" src=\"http://photocdn.sohu.com/20160120/Img435197841.jpeg\" style=\"height:368px; width:520px\" />\n<div class=\"conserve-photo\" style=\"top: 1038px; left: 473px; display: block;\">\n<div class=\"comCount\">0</div>\n</div>\n</div>\n<span style=\"font-size:12px\">　　2015年12月4日，中国国家主席习近平在约翰内斯堡会见埃及总理伊斯梅尔。新华社记者张铎 摄</span>\n\n<p>　　据新华社2015年12月4日报道，中国国家主席习近平12月4日在约翰内斯堡会见埃及总理伊斯梅尔。</p>\n\n<p>　　习近平指出，中方始终从战略高度看待和推进中埃全面战略伙伴关系,一如既往支持埃及稳定和发展<br />\ndskfas dfsdakf asdfsd</p>\n</div>\n</div>','AAAA','BBBB','dsfas@dfasd.com','','','','sadfsadfsadf','sadfsadfsds',NULL,NULL,'','',0,0,0,1,0,1453166743,1453338647),(2,0,3,6,'ddsfsdaf','sdafsdf','fsd','dfasdfsadf','sdafsd','<div class=\"columnD contA blockA\">\n<div id=\"pic-roll\">\n<div id=\"pic-wrap\">\n<div id=\"pic-cont\" style=\"width: 1520px; left: -760px;\">\n<ul>\n	<li><a href=\"http://pic.news.sohu.com/group-709516.shtml\" target=\"_blank\"><img src=\"http://i3.itc.cn/20160120/3616_166aefee_7e75_3ebb_3b83_0ce6c9d26294_1.jpg\" /></a><a href=\"http://pic.news.sohu.com/group-709516.shtml\" target=\"_blank\">&ldquo;重量级&rdquo;舞团挑战地球引力</a></li>\n	<li><a href=\"http://pic.news.sohu.com/group-709484.shtml\" target=\"_blank\"><img src=\"http://i1.itc.cn/20160120/3616_c24fc219_d934_0cca_9769_428990b78ea8_1.jpg\" /></a><a href=\"http://pic.news.sohu.com/group-709484.shtml\" target=\"_blank\">无差别扫射 巴基斯坦一大学遭袭</a></li>\n	<li><a href=\"http://pic.news.sohu.com/group-709498.shtml\" target=\"_blank\"><img src=\"http://i1.itc.cn/20160120/3616_148ab88a_6bd4_cf62_1ece_6468c8d87640_1.jpg\" /></a><a href=\"http://pic.news.sohu.com/group-709498.shtml\" target=\"_blank\">&ldquo;美女&rdquo;原都是真汉子 dsafasdf