\"http://pic.yule.sohu.com/group-709381.shtml\" target=\"_blank\" title=\"\">姐弟恋？刘昊然谭松韵同回酒店</a></li>\n	<li><a href=\"http://yule.sohu.com/20160119/n435099666.shtml\" target=\"_blank\" title=\"\">黄毅清晒视频女儿称被妈妈打脸</a></li>\n	<li><a href=\"http://pic.yule.sohu.com/group-709374.shtml\" target=\"_blank\" title=\"\">郑爽爸的择婿标准：长相不重要</a></li>\n	<li><a href=\"http://yule.sohu.com/20160119/n435066838.shtml\" target=\"_blank\" title=\"\">回顾:张艺兴聊电影&lt;极限挑战&gt;</a></li>\n	<li><a href=\"http://yule.sohu.com/20160120/n435217109.shtml\" target=\"_blank\" title=\"\">猴年春晚主题曝光：全面建小康</a></li>\n</ul>\n\n<ul>\n	<li>&nbsp;</li>\n</ul>\n</div>\n</div>','Tomsun','2015年12月18日 晚上 9：00 ~ 12：30','tomsun@hotmail.com','','','','Canadaway','Burnaby',NULL,NULL,'聚会','派对',0,0,50,1,0,1453225309,1453337044),(3,0,3,7,'UBC Info Session','据经济之声《央广财经评论》报道，中国经济已进入新常态，如何在新常态中保持平稳的发展？经济工作的抓手是什么？刚刚过去的2015年，国务院总理李克强给出妙解是，通过“双引擎”促进“双中高”。','UBC 入学介绍','为啥杭州感觉更冷？\n\n　　杭州已经飘起雪花，接下来就要迎接这场多年罕见寒潮的考验了。不过，也有不少网友纳闷，冬天的杭州气温尽管很低，但比起动辄零下十几度的北方来讲，总是小巫见大巫吧？可为啥气温比较高的杭州冬天反而感觉更冷呢？','<p>　早在2015年1月21日，李克强总理在瑞士达沃斯论坛上特别致辞时，就首次提出了&ldquo;双中高&rdquo;和&ldquo;双引擎&rdquo;这两个关键词。李克强指出，中国经济要 长期保持中高速增长，迈向中高端水平，必须用好政府和市场这&ldquo;两只手&rdquo;，开启&ldquo;双引擎&rdquo;。一是打造新引擎，推动大众创业、万众创新，释放民智民力，增进大 众福祉，实现人生价值，推动社会纵向流动，促进社会公平正义。二是要改造传统引擎，重点是扩大公共产品和公共服务供给，补齐&ldquo;短板&rdquo;，政府要加大财政投 入，同时加大投融资、价格体制改革，积极动员社会力量参与，要深化财税、金融等体制改革，加强市场监管，建立公平竞争环境。</p>\n\n<p>　　双中高，双引擎，这样的表述不仅让世界眼前一亮，也成为2015年中国经济发展的主基调。李克强总理讲话发出的明确信号是，从传统的投资、消费和出口&ldquo;三驾马车&rdquo;到&ldquo;双引擎&rdquo;，中国经济的脉络有了更为清晰的变化。</p>\n\n<p>　　全国政协委员、经济学家张连起评价，经济新常态下，中国把经济增速目标放缓至&ldquo;中高速&rdquo;，将发展目标升级为&ldquo;中高端&rdquo;，符合经济发展内在规律， 是进一步推动结构性改革的需要。由于我们经济体量很大，每年7%左右的增长，GDP年度增量也达到8000多亿美元，合人民币48000多亿元，这个数字 差不多相当于1996年全年GDP总额。跟以前相比，现在每增长一个百分点，它的内容、质量、效益、结构完全不一样，这是一个非常朴素和深刻的道理。我们 自身回旋空间比较大，韧性也比较强，中国的经济&ldquo;列车&rdquo;，速度是放缓了，但不是失速。</p>\n\n<p>　　在李克强总理提出&ldquo;双中高&rdquo;和&ldquo;双引擎&rdquo;两个月后，&ldquo;双引擎&rdquo;打造&ldquo;双中高&rdquo;的表述，又被写进了政府工作报告。</p>\n\n<p>　　此后，&ldquo;大众创业、万众创新&rdquo;与&ldquo;增加公共产品、公共服务供给&rdquo;这经济增长的&ldquo;双引擎&rdquo;，始终贯穿在2015年的国务院常务会议中，&ldquo;大众创业、万众创新&rdquo;在会议中出现频率相当高&mdash;&mdash;</p>\n\n<p>　　1月28日，国务院常务会议确定，支持发展&ldquo;众创空间&rdquo;的政策措施，为创业创新搭建新平台，培育创客文化，让创业创新蔚然成风。</p>\n\n<p>　　6月4日，国务院常务会议提出，要取消妨碍人才自由流动的户籍、学历等限制，营造创业创新便利条件。</p>\n\n<p>　　6月10日，国务院常务会议明确，支持农民工、大学生和退役士兵等返乡创业，通过大众创业、万众创新使广袤乡镇百业兴旺。</p>\n\n<p>　　10月21日，国务院常务会议强调，完善研发费用加计扣除政策，这是落实创新驱动发展战略，以定向结构性减税拉动有效投资、推动&ldquo;双创&rdquo;、促进产业升级的重要举措。</p>\n\n<p>　　这一系列措施，大大推动了大众创业创新的热情。2015年，我国市场主体继续保持快速发展的良好势头，全国新登记企业443.9万户，同比增长21.6%，平均每天新登记企业1.2万户左右，创历史新高。</p>\n\n<p>　　作为&ldquo;双引擎&rdquo;的另一项重要内容，提高公共产品和公共服务的效率，增加供给也是2015年政府工作的重点。</p>\n\n<p>　　李克强总理曾列举过这样一组数据：目前中国公共设施的存量仅为西欧国家的38%，北美国家的23%，服务业水平比同等发展中国家还要低10个百分点，而城镇化率则比发达国家低20多个百分点。</p>\n\n<p>　　中国农业银行首席经济学家向松祚指出，在打造传统引擎的过程中，通过政府之手提升服务业的发展是关键。中国服务业水平比较落后，这每个人都能感 觉到，特别是欠发达地区、农村地区的感受更加强烈。我们过去30多年的发展，是靠制造业、靠基础设施来推动的，未来要抓住老百姓的核心关切，围绕推进服务 业的发展，拉动中国经济增长。</p>\n\n<p>　　他举例说，我们的教育资源特别是好的教育资源非常缺乏，即使在北京这样的首都城市，大家为了上一个好的中学、好的幼儿园都简直要打破脑袋；再比如医院，全国的人都要到北京看病，北京的人都要跑到协和医院看病；至于文化娱乐设施等，很多农村基本上没有。</p>\n\n<p>　　解决百姓关切，就要提高政府公共服务意识。这样的政策，也在过去一年的国务院常务会议中密集发布&mdash;&mdash;</p>\n\n<p>　　2月25日，决定进一步强化城镇棚户区和城乡危房改造及配套基础设施建设。</p>\n\n<p>　　5月13日，部署推广政府和社会资本合作模式，汇聚社会力量增加公共产品和服务供给。</p>\n\n<p>　　6月17日，部署加大重点领域有效投资，发挥稳增长、调结构、惠民生的多重作用。</p>\n\n<p>　早在2015年1月21日，李克强总理在瑞士达沃斯论坛上特别致辞时，就首次提出了&ldquo;双中高&rdquo;和&ldquo;双引擎&rdquo;这两个关键词。李克强指出，中国经济要 长期保持中高速增长，迈向中高端水平，必须用好政府和市场这&ldquo;两只手&rdquo;，开启&ldquo;双引擎&rdquo;。一是打造新引擎，推动大众创业、万众创新，释放民智民力，增进大 众福祉，实现人生价值，推动社会纵向流动，促进社会公平正义。二是要改造传统引擎，重点是扩大公共产品和公共服务供给，补齐&ldquo;短板&rdquo;，政府要加大财政投 入，同时加大投融资、价格体制改革，积极动员社会力量参与，要深化财税、金融等体制改革，加强市场监管，建立公平竞争环境。</p>\n\n<p>　　双中高，双引擎，这样的表述不仅让世界眼前一亮，也成为2015年中国经济发展的主基调。李克强总理讲话发出的明确信号是，从传统的投资、消费和出口&ldquo;三驾马车&rdquo;到&ldquo;双引擎&rdquo;，中国经济的脉络有了更为清晰的变化。</p>\n\n<p>　　全国政协委员、经济学家张连起评价，经济新常态下，中国把经济增速目标放缓至&ldquo;中高速&rdquo;，将发展目标升级为&ldquo;中高端&rdquo;，符合经济发展内在规律， 是进一步推动结构性改革的需要。由于我们经济体量很大，每年7%左右的增长，GDP年度增量也达到8000多亿美元，合人民币48000多亿元，这个数字 差不多相当于1996年全年GDP总额。跟以前相比，现在每增长一个百分点，它的内容、质量、效益、结构完全不一样，这是一个非常朴素和深刻的道理。我们 自身回旋空间比较大，韧性也比较强，中国的经济&ldquo;列车&rdquo;，速度是放缓了，但不是失速。</p>\n\n<p>　　在李克强总理提出&ldquo;双中高&rdquo;和&ldquo;双引擎&rdquo;两个月后，&ldquo;双引擎&rdquo;打造&ldquo;双中高&rdquo;的表述，又被写进了政府工作报告。</p>\n\n<p>　　此后，&ldquo;大众创业、万众创新&rdquo;与&ldquo;增加公共产品、公共服务供给&rdquo;这经济增长的&ldquo;双引擎&rdquo;，始终贯穿在2015年的国务院常务会议中，&ldquo;大众创业、万众创新&rdquo;在会议中出现频率相当高&mdash;&mdash;</p>\n\n<p>　　1月28日，国务院常务会议确定，支持发展&ldquo;众创空间&rdquo;的政策措施，为创业创新搭建新平台，培育创客文化，让创业创新蔚然成风。</p>\n\n<p>　　6月4日，国务院常务会议提出，要取消妨碍人才自由流动的户籍、学历等限制，营造创业创新便利条件。</p>\n\n<p>　　6月10日，国务院常务会议明确，支持农民工、大学生和退役士兵等返乡创业，通过大众创业、万众创新使广袤乡镇百业兴旺。</p>\n\n<p>　　10月21日，国务院常务会议强调，完善研发费用加计扣除政策，这是落实创新驱动发展战略，以定向结构性减税拉动有效投资、推动&ldquo;双创&rdquo;、促进产业升级的重要举措。</p>\n\n<p>　　这一系列措施，大大推动了大众创业创新的热情。2015年，我国市场主体继续保持快速发展的良好势头，全国新登记企业443.9万户，同比增长21.6%，平均每天新登记企业1.2万户左右，创历史新高。</p>\n\n<p>　　作为&ldquo;双引擎&rdquo;的另一项重要内容，提高公共产品和公共服务的效率，增加供给也是2015年政府工作的重点。</p>\n\n<p>　　李克强总理曾列举过这样一组数据：目前中国公共设施的存量仅为西欧国家的38%，北美国家的23%，服务业水平比同等发展中国家还要低10个百分点，而城镇化率则比发达国家低20多个百分点。</p>\n\n<p>　　中国农业银行首席经济学家向松祚指出，在打造传统引擎的过程中，通过政府之手提升服务业的发展是关键。中国服务业水平比较落后，这每个人都能感 觉到，特别是欠发达地区、农村地区的感受更加强烈。我们过去30多年的发展，是靠制造业、靠基础设施来推动的，未来要抓住老百姓的核心关切，围绕推进服务 业的发展，拉动中国经济增长。</p>\n\n<p>　　他举例说，我们的教育资源特别是好的教育资源非常缺乏，即使在北京这样的首都城市，大家为了上一个好的中学、好的幼儿园都简直要打破脑袋；再比如医院，全国的人都要到北京看病，北京的人都要跑到协和医院看病；至于文化娱乐设施等，很多农村基本上没有。</p>\n\n<p>　　解决百姓关切，就要提高政府公共服务意识。这样的政策，也在过去一年的国务院常务会议中密集发布&mdash;&mdash;</p>\n\n<p>　　2月25日，决定进一步强化城镇棚户区和城乡危房改造及配套基础设施建设。</p>\n\n<p>　　5月13日，部署推广政府和社会资本合作模式，汇聚社会力量增加公共产品和服务供给。</p>\n\n<p>　　6月17日，部署加大重点领域有效投资，发挥稳增长、调结构、惠民生的多重作用。</p>\n\n<p>　　8月28日，国务院常务会议部署推进城市地下综合管廊建设，扩大公共产品供给提高新型城镇化质量。</p>\n\n<p>　　中国国际经济交流中心区域研究部副研究员马庆斌表示，&ldquo;双引擎&rdquo;和&ldquo;双中高&rdquo;，这两个词会在未来很长一段时间内，作为经济社会发展中主要的抓 手。它是我国针对特殊发展阶段和经济社会发展的主要矛盾提出的战略性举措。十八大以来，我们强调要让市场发挥决定性作用，同时要更好发挥政府作用。实际上 &ldquo;双引擎&rdquo;本身就是实现政府&ldquo;有形之手&rdquo;和市场&ldquo;无形之手&rdquo;很好结合的政策落实，主要目的还是稳增长、调结构、惠民生。</p>\n\n<p>　　&ldquo;双中高&rdquo;提出了新常态下的经济发展目标，&ldquo;双引擎&rdquo;提供了实现目标的引领动力。马庆斌认为，从实际效果来看，我们经济增长从&ldquo;高速&rdquo;变成了 &ldquo;中高速&rdquo;；与此同时，从&ldquo;传统驱动&rdquo;到&ldquo;双引擎驱动&rdquo;，我们的发展质量也正在走向&ldquo;中高端&rdquo;。也就是说，刚刚过去的2015年，&ldquo;双引擎&rdquo;正在强力促进 &ldquo;双中高&rdquo;。这，正是我们所希望看到的。（记者 李硕）</p>\n\n<div class=\"original-tit\">原标题：李克强：&ldquo;双引擎&rdquo;驱动中国经济&ldquo;双中高&rdquo;</div>\n\n<div class=\"text clear\" id=\"contentText\">\n<div>\n<div><img alt=\"\" src=\"http://i0.itc.cn/20160120/3452_11d64f34_3e4c_3c98_4b08_2234e97e895d_1.jpg\" /></div>\n</div>\n</div>\n\n<p>　　8月28日，国务院常务会议部署推进城市地下综合管廊建设，扩大公共产品供给提高新型城镇化质量。</p>\n\n<p>　　中国国际经济交流中心区域研究部副研究员马庆斌表示，&ldquo;双引擎&rdquo;和&ldquo;双中高&rdquo;，这两个词会在未来很长一段时间内，作为经济社会发展中主要的抓 手。它是我国针对特殊发展阶段和经济社会发展的主要矛盾提出的战略性举措。十八大以来，我们强调要让市场发挥决定性作用，同时要更好发挥政府作用。实际上 &ldquo;双引擎&rdquo;本身就是实现政府&ldquo;有形之手&rdquo;和市场&ldquo;无形之手&rdquo;很好结合的政策落实，主要目的还是稳增长、调结构、惠民生。</p>\n\n<p>　　&ldquo;双中高&rdquo;提出了新常态下的经济发展目标，&ldquo;双引擎&rdquo;提供了实现目标的引领动力。马庆斌认为，从实际效果来看，我们经济增长从&ldquo;高速&rdquo;变成了 &ldquo;中高速&rdquo;；与此同时，从&ldquo;传统驱动&rdquo;到&ldquo;双引擎驱动&rdquo;，我们的发展质量也正在走向&ldquo;中高端&rdquo;。也就是说，刚刚过去的2015年，&ldquo;双引擎&rdquo;正在强力促进 &ldquo;双中高&rdquo;。这，正是我们所希望看到的。（记者 李硕）</p>','<div>\n<p>　浙江在线杭州1月20日讯(浙江在线记者/金许斌 李鹏 首席编辑/赵洁)虽然&ldquo;BOSS级&rdquo;寒潮有点吓人，但在它刚刚来临的今夜，很多喜欢浪漫的杭州人，还是很期待市区能够飘起雪花。</p>\n\n<p>　　傍晚6点10分左右，守候许久的摄影师里尔终于在西湖边的集贤亭拍到了雪景。同一时间，气象部门在西湖附近也监测到了&ldquo;雷达回波&rdquo;，这意味着，杭州市区今年的第一场雪飘起来了。</p>\n\n<p>　　<strong>杭州市区飘起今年第一场雪</strong></p>\n\n<p>　　<strong>摄影师傍晚西湖边拍下雪景</strong></p>\n\n<p>　　今天下午2点前后，杭州西边的淳安、建德等县市已经飘起了雪，这也是浙江全省最早飘雪的地方，不过，苦等了许久，可因为城市热岛效应等原因，杭州主城区还是没有看到雪的影子。</p>\n\n<p>　　不过，好消息终于还是传来了。一直在西湖边等候拍雪景的摄影师里尔，在傍晚6点10分左右，在西湖的集贤亭拍到了雪景，有图有真相哦。他把照片分享在微博上，还顺便@了杭州市气象局官方微博的小编，小编也浪漫地回复说，&ldquo;虽然只是片影，但也令人心喜&rdquo;。</p>\n\n<p>　　浙江在线记者从杭州市气象服务中心了解到，气象部门在杭州西湖附近的确监测到了&ldquo;雷达回波&rdquo;，这也意味着，杭州市区今年的第一场雪已经飘起来了。不过，现在也只是雨夹雪，后半夜到明天上午才有纯粹的雪花飘落。</p>\n\n<p>　　杭州市区终于下雪了！网友们纷纷在网上发表了自己的心情，有欣喜的，也有无奈的。网友&rdquo;苏小四&ldquo;说：将前排座椅放倒，躺在椅子上通过全景天窗看 下雪，简直了！网友&rdquo;YOYO思密达&ldquo;说：下雪的时候，和喜欢的人出来走走，因为一不小心，就一起白了头！&ldquo;神秘的花美男&rdquo;说：希望不要大雪啊，对于上班 的人来说，这样的浪漫受不起。</p>\n　　不过，这次寒潮毕竟是&ldquo;BOSS级&rdquo;的，虽然刚开始还有点小浪漫，但一定不能对它放松警惕。杭州市气象台也在今天下午5点01分发布了暴雪黄色预警，预计今天夜里到明天小雪转大到暴雪，高山区大暴雪，后天降雪持续，将对交通、农林业生产、人民生活有较大影响。</div>\n\n<div>\n<div><img alt=\"里尔 摄\" src=\"http://photocdn.sohu.com/20160121/Img435283513.jpeg\" style=\"height:293px; width:440px\" />\n<div class=\"conserve-photo\" style=\"top: 2192px; left: 430px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n\n<div><span style=\"font-size:12px\">里尔 摄</span></div>\n</div>\n&nbsp;\n\n<p>　　<strong>气温数值高过北方</strong></p>\n\n<p>　　<strong>为啥杭州感觉更冷？</strong></p>\n\n<p>　　杭州已经飘起雪花，接下来就要迎接这场多年罕见寒潮的考验了。不过，也有不少网友纳闷，冬天的杭州气温尽管很低，但比起动辄零下十几度的北方来讲，总是小巫见大巫吧？可为啥气温比较高的杭州冬天反而感觉更冷呢？</p>\n\n<p>　　浙江在线记者专门咨询了浙江省气象服务中心首席服务专家李瑞民。他说，这是因为北方是干冷，南方是湿冷。虽然北方气温低，可湿度也低，所以北方 的冷主要是风大，一般裹紧衣服就好很多。但南方不一样，虽然气温高，可湿度也大，这种冷是刺骨的冷，穿厚衣服也起不了多大作用。</p>\n\n<p>　　因此，气温和体感温度是有差异的，主要是湿度有区别。研究表明，湿度每增加10%，人的体感温度就会降低1℃。换句话说，就算南方气温高3℃，但如果湿度比北方高30%，那么体感温度是一样的。</p>\n\n<p><strong>&nbsp;&nbsp;&nbsp; 新闻加点料</strong></p>\n\n<p><strong>&nbsp;&nbsp;&nbsp; 西湖管委会：湖心亭踏冰看雪不靠谱</strong></p>\n\n<p>&nbsp;&nbsp;&nbsp; 据新华社电 随着&quot;霸王级&quot;寒潮来袭，杭州西湖再次成为微信朋友圈、微博关注的焦点。不少网友翻出1977年西湖湖面结冰的照片，跃跃欲试想踏上冰面徒步来个&quot;湖心亭看雪&quot;。杭州西湖风景名胜区管理委员会提醒，安全第一。</p>\n\n<p>&nbsp;&nbsp;&nbsp; 根据杭州市气象台20日17时01分发布的暴雪黄色预警，预计20日傍晚到23日早晨有大雪暴雪天气过程。20日夜里到21日小雪转大到暴雪，高山区大暴雪。</p>\n\n<p>&nbsp;&nbsp;&nbsp; 杭州西湖景区管委会相关负责人表示，虽然气温将会极低，但是西湖发生像1977年那样的大面积结冰预计不太可能。</p>\n\n<p>&nbsp;&nbsp;&nbsp; 据介绍，1976年西湖平均水深仅为1.47米，1977年的情况基本与1976年差不多，而时下西湖的平均水深为2.5米。同时，西湖水域面积也相比之前扩大不少。与1977年相比，西湖的容积和蓄水量都大了很多，这意味着西湖的热容量也相应增大。</p>\n\n<p>&nbsp;&nbsp;&nbsp; 另一个因素是，钱塘江引配水工程实施后，西湖水体循环加速，西湖水的流动性增强。此外，城市的热岛效应，也会影响西湖结冰的速度和厚度。</p>\n\n<p>&nbsp;&nbsp;&nbsp; 综合以上因素，上述负责人说，西湖没有那么容易结冰，即使结冰也不会像以往那么结实，且不同区域结冰程度不一，冰面容易开裂。</p>\n\n<p>&nbsp;&nbsp;&nbsp; 今天醒来，杭州的小伙伴可能会发现，杭城已经白茫茫一片，雪的规格也将逐步上升&mdash;&mdash;杭州市气象台预计，今天上午杭州中雪转大雪，下午到明天大雪到暴雪。今 天东北风3~4级阵风5级，白天最高气温2℃，早晨最低气温0℃，有薄冰，平均相对湿度90%。今天夜里到明天上午平原地区以雨夹雪为主，山区有中到大 雪。</p>\n\n<p>&nbsp; &nbsp;<strong> 寒潮将至杭州民众排队囤油 超市货架被抢空</strong></p>\n\n<p>&nbsp; &nbsp; 寒潮的大部队还没到，杭城的大伙儿已经忙开了。囤菜的囤菜，囤油的囤油，囤面包的囤面包。</p>\n\n<p>&nbsp; &nbsp; 清晨的菜场里，&quot;马大嫂&quot;早就在青菜还没涨太多的时候下手了，蔬菜、禽蛋、肉类、豆制品&hellip;&hellip;全都卖得很好，听说气温要跌到零下好几度，柴油车司机也已经坐不住了，赶紧去加油站抢加-10号柴油，不过队伍已经排得老长了&hellip;&hellip;</p>\n\n<p>&nbsp; &nbsp; 各位亲爱的们，我们想告诉大家的是，无论是菜场超市还是中石油中石化，无论是蔬菜禽蛋肉类面包还是-10号柴油，目前的供应都是很充足的。</p>\n\n<p><strong>&nbsp; &nbsp; @菜场有人开口就要了10斤小青菜</strong></p>\n\n<p>&nbsp; &nbsp; 昨天凌晨2点，杭州大浒东苑农贸市场的摊贩吴小琴就赶往蔬菜批发市场进货。&quot;比平时提早了2个小时到，大白菜和芹菜我还是没抢到。&quot;吴小琴说，好在自己提前订了7大包小青菜，大约150斤的样子。</p>\n\n<p>&nbsp; &nbsp; 早上一开摊，吴小琴将小青菜的卖价从3.5元/斤提到了5.5元/斤，&quot;不是我瞎涨价，天要冷了，今天的批发价就不便宜。&quot;熟客们一开始都抱怨菜价高，但听完吴小琴的话，都买了两天的小青菜分量。</p>\n\n<p>&nbsp; &nbsp; 中午一过，吴小琴发现来买菜的人有了囤菜的迹象。&quot;开口就是五六斤，最豪气的是有个30岁左右的女子，买了一百多块钱的蔬菜，光小青菜就买了十斤。&quot;</p>\n\n<p>&nbsp; &nbsp; 下午的时候，小青菜涨到了6.5元/斤，但是吴小琴的小青菜还是很快就卖光了。&quot;一般一天也就卖30斤，今天150斤都卖光了。&quot;</p>\n\n<p>&nbsp; &nbsp; 昨天的菜场盛况，是摊贩们都没有预料到的。卖猪肉的大姐，一上午就卖光了原先一天的猪肉，很早便收摊回家了。</p>\n\n<div class=\"mod-con\">\n<ul>\n	<li>\n	<div class=\"pic\"><a class=\"apic\" href=\"http://tv.sohu.com/20160106/n433646705.shtml\" target=\"_blank\" title=\"实拍老公怒气捉奸 现场把男小三儿和老婆揍翻\"><img src=\"http://photocdn.sohu.com/20160106/37cfe7b4-f96b-4081-9592-f2d022bceddd_2824042_S_b_od5Ey_pic23.jpg\" style=\"height:80px; width:140px\" /></a></div>\n	<strong><a href=\"http://tv.sohu.com/20160106/n433646705.shtml\" target=\"_blank\" title=\"实拍老公怒气捉奸 现场把男小三儿和老婆揍翻\">实拍老公怒气捉奸 现场把男小三儿和老婆揍翻</a></strong>\n\n	<p>&nbsp;</p>\n	</li>\n	<li>\n	<div class=\"pic\"><a class=\"apic\" href=\"http://tv.sohu.com/20160119/n435083001.shtml\" target=\"_blank\" title=\"搞笑集锦：钓鱼出现失误 结局令人捧腹\"><img src=\"http://photocdn.sohu.com/20160119/f1638c28-144d-4fa1-94e2-c1c41fd86ac5_2847961_S_b_CC7l6_pic23.jpg\" style=\"height:80px; width:140px\" /></a></div>\n	<strong><a href=\"http://tv.sohu.com/20160119/n435083001.shtml\" target=\"_blank\" title=\"搞笑集锦：钓鱼出现失误 结局令人捧腹\">搞笑集锦：钓鱼出现失误 结局令人捧腹</a></strong>\n\n	<p>&nbsp;</p>\n	</li>\n	<li>\n	<div class=\"pic\"><a class=\"apic\" href=\"http://tv.sohu.com/20160117/n434800400.shtml\" target=\"_blank\" title=\"海南一名15岁少女遭人围殴 被扒衣拍视频\"><img src=\"http://photocdn.sohu.com/20160117/96f9505a-c635-4606-8088-0211b3d9e720_2843931_S_b_o288O_pic23.jpg\" style=\"height:80px; width:140px\" /></a></div>\n	<strong><a href=\"http://tv.sohu.com/20160117/n434800