,'','','','',NULL,NULL,'','',0,0,343,1,0,1453514100,1453759389),(19,0,1,9,'','','DSFASDF','SADFDSAF','','DASFSDA','','','','','','','','',NULL,NULL,'','',0,0,78,1,0,1453514229,1453759389),(20,14,2,10,'dsfasd adsfsad','fasdfas fasd','中文题目','中文描述','fasd fsadf','<p>　<strong>中东发展的中国方案</strong></p>\n\n<p>　　习近平在演讲中提出，中方愿同阿拉伯国家开展共建&ldquo;一带一路&rdquo;行动，推动中阿两大民族复兴形成更多交汇。</p>\n\n<p>　　前中阿合作论坛事务大使姚匡乙说，习近平主席此访有力推动了&ldquo;一带一路&rdquo;倡议在中东地区的落地和实施，中东地区有可能成为&ldquo;一带一路&rdquo;倡议实施的先导地区。</p>\n\n<p>　　2014年6月，习近平在中阿合作论坛北京部长级会议上提出，中阿共建&ldquo;一带一路&rdquo;，构建以能源合作为主轴，以基础设施建设、贸易和投资便利化为两翼，以核能、航天卫星、新能源三大高新领域为新的突破口的&ldquo;1＋2＋3&rdquo;合作格局。</p>\n\n<p>　　此次演讲中，习近平表示，中方愿同阿方探索&ldquo;石油、贷款、工程&rdquo;一揽子合作模式，参与中东工业园区建设，启动中阿科技伙伴计划，设立150亿美 元的中东工业化专项贷款，分别向中东国家提供100亿美元商业性贷款和100亿美元优惠性质贷款，同阿联酋、卡塔尔设立共计200亿美元共同投资基金&hellip;&hellip;</p>\n\n<p>　　中国社科院西亚非洲研究所中东研究室主任唐志超说，这些新的举措是对&ldquo;1＋2＋3&rdquo;格局框架下合作的一个升级，将中东国家的发展战略与&ldquo;一带一路&rdquo;倡议进一步对接，双方的合作将更加多元。</p>\n\n<p>　　&ldquo;习近平主席在提高中阿务实合作含金量、促进中东工业化方面提出了</p>\n\n<div class=\"original-tit\">原标题：习近平抵达德黑兰开始对伊朗进行国事访问</div>\n\n<div class=\"text clear\" id=\"contentText\">\n<div>\n<div><img alt=\"1月22日，国家主席习近平乘专机抵达伊朗首都德黑兰，开始对伊朗进行国事访问。这是在梅赫拉巴德机场，习近平受到伊朗外交部长扎里夫等热情迎接。新华社记者饶爱民摄\" src=\"http://photocdn.sohu.com/20160123/Img435578974.jpeg\" /><br />\nsdfasdf</div>\n</div>\n</div>','','2016-01-22 18:12:58','eeee@eee.com','','','','','',NULL,NULL,'','',1,0,89,1,0,1453515335,1453834281),(21,0,2,0,'','','dsf','asdf asdfsdaf','','sadf sadf asfsd','雪上飞葫',NULL,'bb3343b@bbb.com','604-887-9987','778-988-8989',NULL,'3659 Canada Way','Burnaby',NULL,NULL,'','',0,0,0,1,1,1454362363,0),(22,0,2,10,'','','dsfasdf','asdfsadf','','sa fasfsadfdsaf','雪上飞葫',NULL,'bb3343b@bbb.com','604-887-9987','778-988-8989',NULL,'3659 Canada Way','Burnaby',NULL,NULL,'','',0,0,0,1,1,1454365016,0),(23,0,2,9,'','','dsf','asdfasdf','','dfadsfdsaf','雪上飞葫',NULL,'bb3343b@bbb.com','604-887-9987','778-988-8989',NULL,'3659 Canada Way','Burnaby',NULL,NULL,'','',0,0,0,1,1,1454365322,0),(24,0,2,8,'sadf asdfsadf','sadf sa'