FSDAF SADF SDFDS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,1,0,0,0),(62,0,2,12,'Big Snow this year','','大雪纷飞的日子','　泛太平洋战略经济伙伴关系协定（TPP）取得实质性突破。美国、日本、澳大利亚、文莱、加拿大、智利、马来西亚、墨西哥、新西兰、秘鲁、新加坡和越南12个国家在新西兰城市奥克兰正式签署了TPP协议。这12个国家加起来占全球经济的比重达到40%，超过欧盟。\n\n　　日本首相\n相关公司股票走势\n\n\n\n　　TPP协议由美国主导，最早于5年之前启动。TPP谈判由两大部分构成：一是知识产权保护规则等所有12个谈判参与国一起决定的领域；二是诸如某种物品关税减免等双边磋商领域。12个谈判国同意进行自由贸易，并在投资及知识产权等广泛领域统一规范。',NULL,'<p>　泛<a href=\"http://q.stock.sohu.com/cn/601099/index.shtml\" target=\"_blank\">太平洋</a>战略经济伙伴关系协定（TPP）取得实质性突破。美国、日本、澳大利亚、文莱、加拿大、智利、马来西亚、墨西哥、新西兰、秘鲁、新加坡和越南12个国家在新西兰城市奥克兰正式签署了TPP协议。<strong>这12个国家加起来占全球经济的比重达到40%，超过欧盟。</strong></p>\n\n<p>　　日本首相</p>\n\n<div class=\"muLink\">\n<div class=\"stockTrends\">\n<div class=\"line\">&nbsp;</div>\n\n<h3>相关公司股票走势</h3>\n<a href=\"http://q.stock.sohu.com/cn/601099/index.shtml\" id=\"related_stock_img\" target=\"blank\"><img src=\"http://d1.biz.itc.cn/q/cn/099/601099/tline2.png?1454615488678\" /></a>\n\n<ul>\n	<li><a href=\"http://q.stock.sohu.com/cn/601099/index.shtml\" target=\"_blank\" title=\"太平洋\">太平洋</a>6.19+0.050.81%</li>\n</ul>\n\n<div class=\"line\">&nbsp;</div>\n</div>\n</div>\n安倍晋三随后称：<strong>签署TPP具有历史意义</strong>。\n\n<p>&nbsp;</p>\n\n<p>　　需要注意的是，<strong>TPP协定还需要各国立法部门（国会、议会）批准通过，不少TPP成员国需要多个步骤才能走完法律程序，预计多数国家最终会批准协议</strong>。不过美国等国家因选举等政治局势复杂，<strong>仍然存在有拖延TPP协议付诸实施的风险</strong>。</p>\n\n<p>　　路透今日援引新西兰总理约翰基称，签署TPP是&ldquo;重要的一步&rdquo;，<strong>但在真正生效以前，该协议仍只是一堆纸</strong>。</p>\n\n<p>　　TPP协议由美国主导，最早于5年之前启动。TPP谈判由两大部分构成：一是知识产权保护规则等所有12个谈判参与国一起决定的领域；二是诸如某种物品关税减免等双边磋商领域。<strong>12个谈判国同意进行自由贸易，并在投资及知识产权等广泛领域统一规范</strong>。</p>','雪花飘','','william@hotmail.com','604.898.3945','778-993-9983','','#605 4568 Silver House Ave.','Vanvoucer',NULL,NULL,'','',2,0,99,1,0,1454615468,1454731670),(63,0,2,1,'Stock Service is donw','','股票蒸蛋的日子','　用颠覆性新技术改造传统产业大有空间\n\n　　2月2日上午，李克强总理走进宁夏“共享装备”的传统铸造车间时，几十位工人正在埋头加工几块半人高的巨大黑色模具。公司董事长彭凡介绍，把三四块打磨好的树脂块拼在一起组成模具，在里面浇上烧融的铁水，随后进行冷加工，就能生产出汽车、轮船等大型装备的核心配件。\n\n　　“全世界60%的铸造业都还在使用这种传统的手工生产方式。”彭凡说。他告诉总理，成立至今的近50年时间，“共享装备”一直维系着这样的生产方式。仅有的两项改进，就是上世纪80年代引进的“新型粘结材料”，和进入新世纪后改造的“环保电炉”。',NULL,'<div class=\"original-tit\">原标题：李克强考察同一家企业：新旧动能呈现冰火两重天</div>\n\n<div class=\"text clear\" id=\"contentText\">\n<div>\n<div><img alt=\"不到一分钟，李克强就从宁夏共享装备股份有限公司的老车间走到了新车间，但这中间却穿越了中国铸造业的两个时代。\" src=\"http://photocdn.sohu.com/20160204/Img436919901.jpeg\" />\n<div class=\"conserve-photo\" style=\"top: 698px; left: 911.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n\n<div>\n<p><span style=\"font-size:12px\">　　不到一分钟，李克强就从宁夏共享装备股份有限公司的老车间走到了新车间，但这中间却穿越了中国铸造业的两个时代。</span></p>\n\n<p>　　始建于1966年&ldquo;共享装备&rdquo;，在&ldquo;三线建设&rdquo;时期从东北搬迁到银川。它的老车间正是传统铸造行业最典型的样貌：一间昏暗而巨大的红砖厂房里摆 满一个个巨大的铁家伙，工人们戴着黄色的安全帽小心翼翼地打磨模具，手上满是黑色的灰垢，脸上还扣着一个用来隔离刺鼻气味的小口罩。</p>\n\n<p>　　而在一路之隔的新厂房里，李克强总理看到的却是另一幅截然不同的场景：刺鼻的气味消失了，砖墙也变成了雪白的墙壁，工人们摘掉了安全帽和口罩，坐在电脑后操作着一台3D打印机。</p>\n\n<p>　　&ldquo;你们对传统产业进行颠覆性改造，让铸造产品由原来的&lsquo;傻大黑粗&rsquo;变成现在的&lsquo;窈窕淑女&rsquo;，可以说是&lsquo;黑白分明&rsquo;、&lsquo;新旧两重天&rsquo;!这真是中国制造业新旧动能转换的生动体现。&rdquo;李克强兴奋地说。</p>\n\n<p>　　总理指出，要进一步加快推进&ldquo;中国制造2025+互联网&rdquo;，让传统制造业&ldquo;浴火重生&rdquo;。</p>\n\n<p>　　<strong>用颠覆性新技术改造传统产业大有空间</strong></p>\n\n<p>　　2月2日上午，李克强总理走进宁夏&ldquo;共享装备&rdquo;的传统铸造车间时，几十位工人正在埋头加工几块半人高的巨大黑色模具。公司董事长彭凡介绍，把三四块打磨好的树脂块拼在一起组成模具，在里面浇上烧融的铁水，随后进行冷加工，就能生产出汽车、轮船等大型装备的核心配件。</p>\n\n<p>　　&ldquo;全世界60%的铸造业都还在使用这种传统的手工生产方式。&rdquo;彭凡说。他告诉总理，成立至今的近50年时间，&ldquo;共享装备&rdquo;一直维系着这样的生产方式。仅有的两项改进，就是上世纪80年代引进的&ldquo;新型粘结材料&rdquo;，和进入新世纪后改造的&ldquo;环保电炉&rdquo;。</p>\n\n<p>　　&ldquo;加工的误差你们能控制在多少?&rdquo;李克强询问一位技术工人。</p>\n\n<p>　　&ldquo;大概一毫米。&rdquo;这位工人回答。</p>\n\n<p>　　&ldquo;按照原来东北的说法就是&lsquo;一杠&rsquo;了。&rdquo;总理说。</p>\n\n<p>　　彭凡连连点头。他说，前几年全球市场需求旺盛的时候，整个公司每年的利润额超过1亿元。但这两年市场需求萎缩很快，竞争格局加剧，2015年企业的销售规模虽然达到了11亿元，但利润额却下降到了5000万元。</p>\n\n<p>　　&ldquo;我们正在探索产业转型升级的道路，这些旧设备、旧技术，我们打算用3～5年时间全部淘汰，换成一套完全&lsquo;颠覆性&rsquo;的新设备。&rdquo;彭凡说，&ldquo;今年，我们的利润将会实现翻番!&rdquo;</p>\n　　&ldquo;你这个消息让我很振奋。&rdquo;李克强说，&ldquo;你们提高利润不是通过降成本，而是通过技术创新。用颠覆性新技术改造传统产业大有空间。&rdquo;</div>\n\n<div><img alt=\"李克强考察同一家企业：新旧动能呈现冰火两重天\" src=\"http://photocdn.sohu.com/20160204/Img436919902.jpeg\" />\n<div class=\"conserve-photo\" style=\"top: 1986px; left: 911.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n\n<div>&nbsp;\n<p>　　<strong>两个人坐在桌子旁边按两个按钮，就把所有活儿都干了</strong></p>\n\n<p>　　沿着厂区的一条小路，李克强从&ldquo;传统铸造车间&rdquo;走进&ldquo;3D打印产业应用中心&rdquo;，仿佛走进了一个&ldquo;新世界&rdquo;：黑黢黢的&ldquo;大块头&rdquo;都不见了，取而代之的是一台巨大的3D打印机。</p>\n\n<p>　　&ldquo;为了研发这个项目，我把企业之前盈利的家底全部投进来了。&rdquo;彭凡说。他告诉总理，这台公司自主研发的3D打印机，通过关键材料、工艺技术等领域的创新，比同类进口产品工作效率提高了3倍，机器价格还降低了一半，材料费更是压缩为进口产品的1/3。</p>\n\n<p>　　&ldquo;以后铸造工人就在这样的车间里工作。整个车间就两个人，坐在桌子旁边按两个按钮，就把所有活儿都干了。&rdquo;彭凡说。</p>\n\n<p>　　彭凡指着一个乒乓球台大小的模具告诉总理，这是3D打印机打出的发动机缸盖模具，是&ldquo;最难的铸件&rdquo;之一。</p>\n\n<p>　　李克强把手伸进模具的狭窄缝隙里量了量：&ldquo;这种形状传统技工很难做，这个精密度完全不一样啊!&rdquo;</p>\n\n<p>　　&ldquo;以前我们要用金属模具做20个零件，再用一个高级工具组装出来。这是一个高级技工培训半年才能干的活儿。&rdquo;彭凡说，&ldquo;但现在，我们用3D打印机一次就能完成，误差也从原来的1毫米降到了0.3毫米。&rdquo;</p>\n　　&ldquo;我们刚才看的是&lsquo;傻大黑粗&rsquo;，现在已经变成&lsquo;窈窕淑女&rsquo;啦!&rdquo;总理幽默地说。车间里的人笑了。</div>\n\n<div><img alt=\"李克强考察同一家企业：新旧动能呈现冰火两重天\" src=\"http://photocdn.sohu.com/20160204/Img436919903.jpeg\" />\n<div class=\"conserve-photo\" style=\"top: 2956px; left: 911.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n\n<div>&nbsp;\n<p>　　<strong>让6000年历史的铸造产业浴火重生</strong></p>\n\n<p>　　看到3D打印机的工作演示后，李克强追问道：&ldquo;你们的设计图纸是从哪来的?&rdquo;</p>\n\n<p>　　彭凡回答：&ldquo;我们现在有和互联网连接的虚拟设计中心，不仅有自己的工程师，也在加大利用&lsquo;外脑&rsquo;，通过互联网在全球寻求解决方案。&rdquo;</p>\n\n<p>　　这位创新者进一步总结说，互联网给企业的科技人员带来了两个前所未有的巨大优势：寻求全球最先进的技术知识，进行性价比最高的全球采购。</p>\n\n<p>　　&ldquo;我以前觉得，中国技术工人还要经过相当长的时间才能赶上一些发达国家。但现在我觉得，随着互联网时代的到来、科技的发展，中国完全可以弯道超车!&rdquo;彭凡说。</p>\n\n<p>　　&ldquo;所以&lsquo;中国制造2025&rsquo;的前途就在于&lsquo;+互联网&rsquo;!&rdquo;李克强接过彭凡的话说，&ldquo;通过互联网借外脑、集众智，可以彻底改造传统行业。中国的制造业大有希望!&rdquo;</p>\n\n<p>　　彭凡还告诉总理，他们计划建设一个制造服务业的&ldquo;云中心&rdquo;，通过互联网为更多铸造企业提供设计服务。&ldquo;下一步我们不光要做铸件，还要出售铸造业智能化的&lsquo;智能工厂&rsquo;!&rdquo;</p>\n\n<p>　　李克强鼓励他搭建一个更加开放的创新平台，吸引大中小企业和科研院所入驻，形成聚集效应，真正打造一个&ldquo;创新中心&rdquo;。</p>\n　　总理说：&ldquo;工业化最基础的产业就是铸造业。你通过互联网和3D打印技术，对传统产业进行颠覆性改造，让6000年历史的铸造产业浴火重生!&rdquo;</div>\n\n<div><img alt=\"李克强考察同一家企业：新旧动能呈现冰火两重天\" src=\"http://photocdn.sohu.com/20160204/Img436919904.jpeg\" />\n<div class=\"conserve-photo\" style=\"top: 3926px; left: 911.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n&nbsp;\n\n<p>　　<strong>你们正在改变中国铸造业的历史</strong></p>\n\n<p>　　共享装备股份有限公司原本是一家典型的铸造业&ldquo;老国企&rdquo;。通过股份制改革，原来的老工人都变成了公司的&ldquo;股东&rdquo;，陈旧的工厂也焕发出了新的生机。</p>\n\n<p>　　在铸造3D产业应用研发现场，李克强见到了企业的十几位技术人员。这些年轻人告诉总理，他们中很多人有硕士、博士学位，而且专业各不相同，有人学材料学，有人学计算机，还有人学机械工程，电器自动化&hellip;&hellip;</p>\n\n<p>　　&ldquo;你们是不同&lsquo;军种&rsquo;的&lsquo;集团军&rsquo;作战，是中国铸造业第一批吃螃蟹的人!&rdquo;李克强鼓励道，&ldquo;更重要的是，你们虽然只有十几个人，却通过互联网集合了十几亿人的智慧，共同推动中国铸造业的转型升级。&rdquo;</p>\n\n<p>　　总理说，共享装备探索的是&ldquo;分享经济&rdquo;、&ldquo;共享经济&rdquo;，不仅推动颠覆性的技术创新，也通过制度创新，充分调动了员工更大的积极性。</p>\n\n<p>　　他鼓励企业负责人要以更加开放的心态，与国内更多制造业企业开展合作，加快推动中国传统制造业的转型升级。</p>\n\n<p>　　&ldquo;现在中国的传统制造业、铸造业正处在艰难转型的时期，但你们这里却显现出了欣欣向荣的希望。&rdquo;总理说，&ldquo;你们正在改造中国铸造业的历史。我希望在不久的将来，看到你们实现更新更大的突破。&rdquo;</p>\n\n<p>　　新京报特约记者 储思琮</p>\n</div>\n</div>','中关村','dksfjaksdl','','604.583.3943','778.988.9383','','','Richmond， New West Minster',NULL,NULL,'','',0,0,0,1,1,1454616538,1454617344),(64,0,2,2,'dfsdafsadf','','sdf asdfdsaf','',NULL,'RFASDFDS','Ddfddfds','','','','','','','dfsdafsda',NULL,NULL,'','',0,0,0,1,1,1454617433,1454618471),(65,0,2,0,'','','','','','','雪上飞葫',NULL,'bb3343b@bbb.com','604-887-9987','778-988-8989',NULL,'3659 Canada Way','Burnaby',NULL,NULL,'','',0,0,0,1,1,1454618133,0),(66,0,2,15,'','','','','','','fddasfsa','','bb3343b@bbb.com','604-887-9987','778-988-8989','','3659 Canada Way','Burnaby',NULL,NULL,'','',0,0,0,1,1,1454618153,1454618510),(67,0,2,2,'','','','','','','雪上飞葫','','bb3343b@bbb.com','604-887-9987','778-988-8989','','3659 Canada Way','Burnaby',NULL,NULL,'','',0,0,0,1,1,1454618174,1454618492),(68,0,2,0,'','','','','','','雪上飞葫',NULL,'bb3343b@bbb.com','604-887-9987','778-988-8989',NULL,'3659 Canada Way','Burnaby',NULL,NULL,'','',0,0,0,1,1,1454618524,0),(69,0,2,0,'','','','','','','雪上飞葫',NULL,'bb3343b@bbb.com','604-887-9987','778-988-8989',NULL,'3659 Canada Way','Burnaby',NULL,NULL,'','',0,0,0,1,1,1454618543,0),(70,0,2,8,'','','教科书的风口浪尖','原标题：习近平同韩国总统朴槿惠通电话：半岛不能有核\n习近平同韩国总统朴槿惠通电话\n　　据新华社电昨天，国家主席习近平同韩国总统朴槿惠通电话。两国领导人互致农历新年问候和祝福，同意共同推动中韩双边关系不断提高到新水平。','','','Eva',NULL,'eee@eee.com','001-3834034234234','sdfasdf',NULL,'','',NULL,NULL,'','',3,0,0,1,0,1454732041,0),(71,0,2,1,'','','外交部长王毅5日与俄罗斯外长拉夫罗夫通电话','[提要]　　外交部长王毅5日与俄罗斯外长拉夫罗夫通电话，就双边关系和共同关心的国际和地区问题交换意见。王毅表示，如果朝鲜要用导弹技术发射卫星，违反联合国安理会决议，得不到国际社会认同，朝方恐怕要付出代价。但他强调，谈判是解决朝核问题唯一途径。','','<div class=\"abstract bgB clear\">\n<div class=\"r\"><strong>[提要]</strong>　　外交部长王毅5日与俄罗斯外长拉夫罗夫通电话，就双边关系和共同关心的国际和地区问题交换意见。王毅表示，如果朝鲜要用导弹技术发射卫星，违反联合国安理会决议，得不到国际社会认同，朝方恐怕要付出代价。但他强调，谈判是解决朝核问题唯一途径。</div>\n</div>\n\n<div class=\"text-pic\">\n<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"tableImg\">\n	<tbody>\n		<tr>\n			<td style=\"text-align:center\"><img alt=\"图为王毅与拉夫罗夫。\" src=\"http://photocdn.sohu.com/20160206/Img437022031.jpg\" />\n			<div class=\"conserve-photo\" style=\"top: 904px; left: 871.5px; display: block;\">\n			<div class=\"comCount\">1</div>\n			</div>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\">图为王毅与拉夫罗夫。&nbsp;<a class=\"savePicBtn\" href=\"javascript:void(0);\">[保存到相册]</a></td>\n		</tr>\n	</tbody>\n</table>\n</div>\n\n<p><br />\n　　据新华社2月5日报道，外交部长王毅5日与俄罗斯外长拉夫罗夫通电话，就双边关系和共同关心的国际和地区问题交换意见。</p>\n\n<p>　　双方高度评价去年中俄全面战略协作伙伴关系取得的一系列标志性成果。一致认为，进入新的一年，面对复杂多变的国际形势，中俄应保持高层互访势头，加强战略沟通，深化战略合作，维护共同战略利益。</p>\n\n<p>　　据俄通社-塔斯社2月4日消息，俄罗斯驻华大使安德烈&middot;杰尼索夫周三对记者表示，俄罗斯总统普京计划在年内访问中国，中国国务院总理李克强也将于年末访问俄罗斯。</p>\n\n<p>　　关于朝鲜半岛核问题，双方一致认为，当前形势下，各方不应再采取激化紧张局势的新行动，应通过安理会决议和各方努力，将半岛核问题重新拉回谈判解决的轨道。</p>\n\n<p><strong>　　延伸阅读：</strong></p>\n\n<p>　　<a href=\"http://mil.sohu.com/20160201/n436487144.shtml\" target=\"_blank\">日本战舰集结欲拦朝鲜导弹 称被中国军机侦查(图)</a></p>\n\n<p>　　<a href=\"http://mil.sohu.com/20160129/n436266161.shtml\" target=\"_blank\">韩媒：朝鲜将射远程导弹 可用核武把首尔轰成灰</a></p>','Eva',NULL,'eee@eee.com','001-3834034234234','sdfasdf',NULL,'','',NULL,NULL,'','',0,0,0,1,0,1454737797,0),(72,0,2,4,'','','fsdf sadfasdfsaf saf sadfasfas asdfasdj fkljasd  aksdfjaskl fasj kasjfklj asdklfjlkasdjlf asdkljf asdjfkasd fls dklfjaskld fsadjflk sflskdsaf','f asfsdfsadf sdfsd ksjdflkas dfjkjdsflk asfj askjdflkasj flkasfjalskjf asfk lasjklsaklfjlskfj l;aalsk;j flasfas\naskdfjl;askjf aslkfj alsdfjlas jfl;asdjfas\nasfjasl;fjl;asdjfl;as','','<div class=\"abstract bgB clear\">\n<div class=\"r\"><strong>[提要]</strong>　　外交部长王毅5日与俄罗斯外长拉夫罗夫通电话，就双边关系和共同关心的国际和地区问题交换意见。王毅表示，如果朝鲜要用导弹技术发射卫星，违反联合国安理会决议，得不到国际社会认同，朝方恐怕要付出代价。但他强调，谈判是解决朝核问题唯一途径。</div>\n</div>\n\n<div class=\"text-pic\">\n<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"tableImg\">\n	<tbody>\n		<tr>\n			<td style=\"text-align:center\"><img alt=\"图为王毅与拉夫罗夫。\" src=\"http://photocdn.sohu.com/20160206/Img437022031.jpg\" />\n			<div class=\"conserve-photo\" style=\"top: 904px; left: 871.5px; display: block;\">\n			<div class=\"comCount\">1</div>\n			</div>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\">图为王毅与拉夫罗夫。&nbsp;<a class=\"savePicBtn\" href=\"javascript:void(0);\">[保存到相册]</a></td>\n		</tr>\n	</tbody>\n</table>\n</div>\n\n<p><br />\n　　据新华社2月5日报道，外交部长王毅5日与俄罗斯外长拉夫罗夫通电话，就双边关系和共同关心的国际和地区问题交换意见。</p>\n\n<p>　　双方高度评价去年中俄全面战略协作伙伴关系取得的一系列标志性成果。一致认为，进入新的一年，面对复杂多变的国际形势，中俄应保持高层互访势头，加强战略沟通，深化战略合作，维护共同战略利益。</p>\n\n<p>　　据俄通社-塔斯社2月4日消息，俄罗斯驻华大使安德烈&middot;杰尼索夫周三对记者表示，俄罗斯总统普京计划在年内访问中国，中国国务院总理李克强也将于年末访问俄罗斯。</p>\n\n<p>　　关于朝鲜半岛核问题，双方一致认为，当前形势下，各方不应再采取激化紧张局势的新行动，应通过安理会决议和各方努力，将半岛核问题重新拉回谈判解决的轨道。</p>\n\n<p><strong>　　延伸阅读：</strong></p>\n\n<p>　　<a href=\"http://mil.sohu.com/20160201/n436487144.shtml\" target=\"_blank\">日本战舰集结欲拦朝鲜导弹 称被中国军机侦查(图)</a></p>\n\n<p>　　<a href=\"http://mil.sohu.com/20160129/n436266161.shtml\" target=\"_blank\">韩媒：朝鲜将射远程导弹 可用核武把首尔轰成灰</a></p>','Eva',NULL,'eee@eee.com','001-3834034234234','sdfasdf',NULL,'','',NULL,NULL,'','',1,0,0,1,0,1454777411,0),(73,0,2,8,'',''