19919,0),(79,15,2,8,'','','kkdkfjs ksjf s','kjsadkfj asd askdfjasd','','sdf asfasfsaf','Eva',NULL,'eee@eee.com','001-3834034234234','sdfasdf',NULL,'sfasfasfas','sdfas',NULL,NULL,'','',1,0,0,1,0,1454831984,0),(80,15,2,1,'','','习近平给全国各族人民拜年','“大家济济一堂、共话新春，不仅是对一年工作生活的相互交流，更是对未来发展的美好期待！”受邀出席今年团拜会的北京市交管局中心区支队五中队长孟昆玉感慨道。','','<p>　　春节，中国人最隆重的传统节日。</p>\n\n<p>　　这不，2月6日，农历除夕前一天，中共中央、国务院在人民大会堂举行2016年春节团拜会，习近平总书记等党和国家领导人出席，给全国人民拜年啦！</p>\n\n<div style=\"overflow: hidden; text-align: center;\">\n<div><img alt=\"2016年2月6日，中共中央、国务院在北京人民大会堂举行2016年春节团拜会。党和国家领导人习近平、李克强、张德江、俞正声、刘云山、王岐山、张高丽等同首都各界人士欢聚一堂，共庆佳节。 新华社记者 庞兴雷 摄\" src=\"http://photocdn.sohu.com/20160207/Img437079541.jpeg\" />\n<div class=\"conserve-photo\" style=\"top: 884px; left: 946.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n<span style=\"font-size:12px\">　　2016年2月6日，中共中央、国务院在北京人民大会堂举行2016年春节团拜会。党和国家领导人习近平、李克强、张德江、俞正声、刘云山、王岐山、张高丽等同首都各界人士欢聚一堂，共庆佳节。 新华社记者 庞兴雷 摄</span></div>\n\n<div>\n<p>　　其实，不仅是春节团拜会，每逢元旦春节，党中央都会以各种方式，向父老乡亲、向社会各界送去新年祝福，表达诚挚问候，接地气、聚民力、暖人心。</p>\n\n<p>　　【习总书记关注老少边穷，走基层】</p>\n\n<p>　　2月2日，农历小年刚过，习近平总书记来到江西省罗霄山脉深处看望老区群众。</p>\n\n<p>　　&ldquo;祝神山村村民生活幸福、老人健康、孩子好好成长，祝乡亲们猴年吉祥！&rdquo;</p>\n　　党的十八大以来，每年春节前夕，习总书记都会深入基层，走村串户，到群众中去，向大家拜年。</div>\n\n<div style=\"overflow: hidden; text-align: center;\">\n<div><img alt=\"2016年2月2日，习近平在井冈山市茅坪乡神山村给乡亲们拜年，祝乡亲们生活幸福、猴年吉祥。 新华社记者 谢环驰 摄\" src=\"http://photocdn.sohu.com/20160207/Img437079542.jpeg\" />\n<div class=\"conserve-photo\" style=\"top: 1554px; left: 946.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n<span style=\"font-size:12px\">　　2016年2月2日，习近平在井冈山市茅坪乡神山村给乡亲们拜年，祝乡亲们生活幸福、猴年吉祥。 新华社记者 谢环驰 摄</span></div>\n\n<div>\n<p>　　总书记去的地方，概括起来就是&ldquo;老少边穷&rdquo;&mdash;&mdash;</p>\n　　&ldquo;老&rdquo;：今年去的江西省井冈山、2015年2月去的陕西省延川县都是革命老区。总书记说，革命老区是党和人民军队的根，我们永远不能忘记自己是从哪里走来的，永远都要从革命的历史中汲取智慧和力量。</div>\n\n<div style=\"overflow: hidden; text-align: center;\">\n<div><img alt=\"2015年2月13日上午，习近平在延安市延川县文安驿镇梁家河村看望村民，并就老区脱贫致富进行实地调研。新华社记者 兰红光 摄\" src=\"http://photocdn.sohu.com/20160207/Img437079541.jpeg\" />\n<div class=\"conserve-photo\" style=\"top: 2136px; left: 946.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n<span style=\"font-size:12px\">　　2015年2月13日上午，习近平在延安市延川县文安驿镇梁家河村看望村民，并就老区脱贫致富进行实地调研。新华社记者 兰红光 摄</span></div>\n\n<div><br />\n　　&ldquo;少&rdquo;：2014年1月去了内蒙古自治区，2013年2月去了甘肃省临夏回族自治州东乡族自治县。总书记说，党和政府高度重视扶贫开发工作，特别是高度重视少数民族和民族地区的发展，一定会给乡亲们更多支持和帮助。</div>','Eva',NULL,'eee@eee.com','13802871875','18639493445',NULL,'5459 Canada Way','Burnaby',NULL,NULL,'','',4,2,0,1,0,1454886919,0),(81,15,2,1,'','','习近平给全国各族人民拜年','“大家济济一堂、共话新春，不仅是对一年工作生活的相互交流，更是对未来发展的美好期待！”受邀出席今年团拜会的北京市交管局中心区支队五中队长孟昆玉感慨道。','','<p>　　春节，中国人最隆重的传统节日。</p>\n\n<p>　　这不，2月6日，农历除夕前一天，中共中央、国务院在人民大会堂举行2016年春节团拜会，习近平总书记等党和国家领导人出席，给全国人民拜年啦！</p>\n\n<div style=\"overflow: hidden; text-align: center;\">\n<div>&nbsp;\n<div class=\"conserve-photo\" style=\"top: 884px; left: 946.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n<span style=\"font-size:12px\">　　2016年2月6日，中共中央、国务院在北京人民大会堂举行2016年春节团拜会。党和国家领导人习近平、李克强、张德江、俞正声、刘云山、王岐山、张高丽等同首都各界人士欢聚一堂，共庆佳节。 新华社记者 庞兴雷 摄</span></div>\n\n<div>\n<p>　　其实，不仅是春节团拜会，每逢元旦春节，党中央都会以各种方式，向父老乡亲、向社会各界送去新年祝福，表达诚挚问候，接地气、聚民力、暖人心。</p>\n\n<p>　　【习总书记关注老少边穷，走基层】</p>\n\n<p>　　2月2日，农历小年刚过，习近平总书记来到江西省罗霄山脉深处看望老区群众。</p>\n\n<p>　　&ldquo;祝神山村村民生活幸福、老人健康、孩子好好成长，祝乡亲们猴年吉祥！&rdquo;</p>\n　　党的十八大以来，每年春节前夕，习总书记都会深入基层，走村串户，到群众中去，向大家拜年。</div>\n\n<div style=\"overflow: hidden; text-align: center;\">\n<div>&nbsp;\n<div class=\"conserve-photo\" style=\"top: 1554px; left: 946.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n<span style=\"font-size:12px\">　　2016年2月2日，习近平在井冈山市茅坪乡神山村给乡亲们拜年，祝乡亲们生活幸福、猴年吉祥。 新华社记者 谢环驰 摄</span></div>\n\n<div>\n<p>　　总书记去的地方，概括起来就是&ldquo;老少边穷&rdquo;&mdash;&mdash;</p>\n　　&ldquo;老&rdquo;：今年去的江西省井冈山、2015年2月去的陕西省延川县都是革命老区。总书记说，革命老区是党和人民军队的根，我们永远不能忘记自己是从哪里走来的，永远都要从革命的历史中汲取智慧和力量。</div>\n\n<div style=\"overflow: hidden; text-align: center;\">\n<div>&nbsp;\n<div class=\"conserve-photo\" style=\"top: 2136px; left: 946.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n<span style=\"font-size:12px\">　　2015年2月13日上午，习近平在延安市延川县文安驿镇梁家河村看望村民，并就老区脱贫致富进行实地调研。新华社记者 兰红光 摄</span></div>\n\n<div><br />\n　　&ldquo;少&rdquo;：2014年1月去了内蒙古自治区，2013年2月去了甘肃省临夏回族自治州东乡族自治县。总书记说，党和政府高度重视扶贫开发工作，特别是高度重视少数民族和民族地区的发展，一定会给乡亲们更多支持和帮助。</div>','Eva',NULL,'eee@eee.com','13802871875','18639493445',NULL,'5459 Canada Way','Burnaby',NULL,NULL,'','',2,2,0,1,0,1454886932,0),(82,15,2,1,'','','习近平给全国各族人民拜年','“大家济济一堂、共话新春，不仅是对一年工作生活的相互交流，更是对未来发展的美好期待！”受邀出席今年团拜会的北京市交管局中心区支队五中队长孟昆玉感慨道。','','<p>　　春节，中国人最隆重的传统节日。</p>\n\n<p>　　这不，2月6日，农历除夕前一天，中共中央、国务院在人民大会堂举行2016年春节团拜会，习近平总书记等党和国家领导人出席，给全国人民拜年啦！</p>\n\n<div style=\"overflow: hidden; text-align: center;\">\n<div>&nbsp;\n<div class=\"conserve-photo\" style=\"top: 884px; left: 946.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n<span style=\"font-size:12px\">　　2016年2月6日，中共中央、国务院在北京人民大会堂举行2016年春节团拜会。党和国家领导人习近平、李克强、张德江、俞正声、刘云山、王岐山、张高丽等同首都各界人士欢聚一堂，共庆佳节。 新华社记者 庞兴雷 摄</span></div>\n\n<div>\n<p>　　其实，不仅是春节团拜会，每逢元旦春节，党中央都会以各种方式，向父老乡亲、向社会各界送去新年祝福，表达诚挚问候，接地气、聚民力、暖人心。</p>\n\n<p>　　【习总书记关注老少边穷，走基层】</p>\n\n<p>　　2月2日，农历小年刚过，习近平总书记来到江西省罗霄山脉深处看望老区群众。</p>\n\n<p>　　祝神山村村民生活幸福、老人健康、孩子好好成长，祝乡亲们猴年吉祥</p>\n　　党的十八大以来，每年春节前夕，习总书记都会深入基层，走村串户，到群众中去，向大家拜年。</div>\n\n<div style=\"overflow: hidden; text-align: center;\">\n<div>&nbsp;\n<div class=\"conserve-photo\" style=\"top: 1554px; left: 946.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n<span style=\"font-size:12px\">　　2016年2月2日，习近平在井冈山市茅坪乡神山村给乡亲们拜年，祝乡亲们生活幸福、猴年吉祥。 新华社记者 谢环驰 摄</span></div>\n\n<div>\n<p>　　总书记去的地方，概括起来就是&ldquo;老少边穷&rdquo;&mdash;&mdash;</p>\n　　&ldquo;老&rdquo;：今年去的江西省井冈山、2015年2月去的陕西省延川县都是革命老区。总书记说，革命老区是党和人民军队的根，我们永远不能忘记自己是从哪里走来的，永远都要从革命的历史中汲取智慧和力量。</div>\n\n<div style=\"overflow: hidden; text-align: center;\">\n<div>&nbsp;\n<div class=\"conserve-photo\" style=\"top: 2136px; left: 946.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n<span style=\"font-size:12px\">　　2015年2月13日上午，习近平在延安市延川县文安驿镇梁家河村看望村民，并就老区脱贫致富进行实地调研。新华社记者 兰红光 摄</span></div>\n\n<div><br />\n　　2014年1月去了内蒙古自治区，2013年2月去了甘肃省临夏回族自治州东乡族自治县。总书记说，党和政府高度重视扶贫开发工作，特别是高度重视少数民族和民族地区的发展，一定会给乡亲们更多支持和帮助。</div>','Eva',NULL,'eee@eee.com','13802871875','18639493445',NULL,'5459 Canada Way','Burnaby',NULL,NULL,'','',2,0,0,1,0,1454886955,0),(83,15,2,1,'','','习近平给全国各族人民拜年','“大家济济一堂、共话新春，不仅是对一年工作生活的相互交流，更是对未来发展的美好期待！”受邀出席今年团拜会的北京市交管局中心区支队五中队长孟昆玉感慨道。','','','Eva',NULL,'eee@eee.com','13802871875','18639493445',NULL,'5459 Canada Way','Burnaby',NULL,NULL,'','',0,0,0,1,0,1454886963,0),(84,15,2,1,'','','习近平给全国各族人民拜年','大家济济一堂、共话新春，不仅是对一年工作生活的相互交流，更是对未来发展的美好期待受邀出席今年团拜会的北京市交管局中心区支队五中队长孟昆玉感慨道。','','<p>　　春节，中国人最隆重的传统节日。</p>\n\n<p>　　这不，2月6日，农历除夕前一天，中共中央、国务院在人民大会堂举行2016年春节团拜会，习近平总书记等党和国家领导人出席，给全国人民拜年啦！</p>\n\n<div style=\"overflow: hidden; text-align: center;\">\n<div><img alt=\"2016年2月6日，中共中央、国务院在北京人民大会堂举行2016年春节团拜会。党和国家领导人习近平、李克强、张德江、俞正声、刘云山、王岐山、张高丽等同首都各界人士欢聚一堂，共庆佳节。 新华社记者 庞兴雷 摄\" src=\"http://photocdn.sohu.com/20160207/Img437079541.jpeg\" />\n<div class=\"conserve-photo\" style=\"top: 884px; left: 946.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n<span style=\"font-size:12px\">　　2016年2月6日，中共中央、国务院在北京人民大会堂举行2016年春节团拜会。党和国家领导人习近平、李克强、张德江、俞正声、刘云山、王岐山、张高丽等同首都各界人士欢聚一堂，共庆佳节。 新华社记者 庞兴雷 摄</span></div>\n\n<div>\n<p>　　其实，不仅是春节团拜会，每逢元旦春节，党中央都会以各种方式，向父老乡亲、向社会各界送去新年祝福，表达诚挚问候，接地气、聚民力、暖人心。</p>\n\n<p>　　【习总书记关注老少边穷，走基层】</p>\n\n<p>　　2月2日，农历小年刚过，习近平总书记来到江西省罗霄山脉深处看望老区群众。</p>\n\n<p>　　&ldquo;祝神山村村民生活幸福、老人健康、孩子好好成长，祝乡亲们猴年吉祥！&rdquo;</p>\n　　党的十八大以来，每年春节前夕，习总书记都会深入基层，走村串户，到群众中去，向大家拜年。</div>\n\n<div style=\"overflow: hidden; text-align: center;\">\n<div><img alt=\"2016年2月2日，习近平在井冈山市茅坪乡神山村给乡亲们拜年，祝乡亲们生活幸福、猴年吉祥。 新华社记者 谢环驰 摄\" src=\"http://photocdn.sohu.com/20160207/Img437079542.jpeg\" />\n<div class=\"conserve-photo\" style=\"top: 1554px; left: 946.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n<span style=\"font-size:12px\">　　2016年2月2日，习近平在井冈山市茅坪乡神山村给乡亲们拜年，祝乡亲们生活幸福、猴年吉祥。 新华社记者 谢环驰 摄</span></div>\n\n<div>\n<p>　　总书记去的地方，概括起来就是&ldquo;老少边穷&rdquo;&mdash;&mdash;</p>\n　　&ldquo;老&rdquo;：今年去的江西省井冈山、2015年2月去的陕西省延川县都是革命老区。总书记说，革命老区是党和人民军队的根，我们永远不能忘记自己是从哪里走来的，永远都要从革命的历史中汲取智慧和力量。</div>\n\n<div style=\"overflow: hidden; text-align: center;\">\n<div><img alt=\"2015年2月13日上午，习近平在延安市延川县文安驿镇梁家河村看望村民，并就老区脱贫致富进行实地调研。新华社记者 兰红光 摄\" src=\"http://photocdn.sohu.com/20160207/Img437079541.jpeg\" />\n<div class=\"conserve-photo conserve-photo-hover\" style=\"top: 2136px; left: 946.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n<span style=\"font-size:12px\">　　2015年2月13日上午，习近平在延安市延川县文安驿镇梁家河村看望村民，并就老区脱贫致富进行实地调研。新华社记者 兰红光 摄</span></div>\n\n<div><br />\n　　&ldquo;少&rdquo;：2014年1月去了内蒙古自治区，2013年2月去了甘肃省临夏回族自治州东乡族自治县。总书记说，党和政府高度重视扶贫开发工作，特别是高度重视少数民族和民族地区的发展，一定会给乡亲们更多支持和帮助。</div>','Eva',NULL,'eee@eee.com','13802871875','18639493445',NULL,'5459 Canada Way','Burnaby',NULL,NULL,'','',0,0,0,1,0,1454886983,0),(85,15,2,1,'','','习近平给全国各族人民拜年','大家济济一堂、共话新春，不仅是对一年工作生活的相互交流，更是对未来发展的美好期待受邀出席今年团拜会的北京市交管局中心区支队五中队长孟昆玉感慨道。','','<p>&ldquo;穷&rdquo;：既有甘肃定西、临夏这样的连片特困地区，也有井冈山市茅坪乡神山村这样的贫困村，还有张成德这样的贫困户。总书记说，在扶贫的路上，不能落贫困家庭，丢贫困群众。</p>\n\n<p>　　【习总书记的关怀无微不至，暖人心】</p>\n\n<p>　　习总书记关心慰问的，有普通村民居民，有坚守岗位的干部职工&mdash;&mdash;</p>\n　　在甘肃兰州城关区&ldquo;虚拟养老院&rdquo;养老餐厅，总书记为就餐的老人端上一盘热气腾腾的饭菜，给老人们拜年，祝愿他们新春愉快、身体健康、安享晚年。','Eva',NULL,'eee@eee.com','13802871875','18639493445',NULL,'5459 Canada Way','Burnaby',NULL,NULL,'','',0,0,0,1,0,1454887010,0),(86,15,2,1,'','','习近平给全国各族人民拜年','大家济济一堂、共话新春，不仅是对一年工作生活的相互交流，更是对未来发展的美好期待受邀出席今年团拜会的北京市交管局中心区支队五中队长孟昆玉感慨道。','','','Eva',NULL,'eee@eee.com','13802871875','18639493445',NULL,'5459 Canada Way','Burnaby',NULL,NULL,'','',1,0,0,1,0,1454887021,0),(87,15,2,1,'','','习近平给全国各族人民拜年','kfldsafklasjflasd  ad skfjasldsdf af','','asdf asfas','Eva',NULL,'eee@eee.com','13802871875','18639493445',NULL,'5459 Canada Way','Burnaby',NULL,NULL,'','',4,0,0,1,0,1454887034,0),(88,15,2,1,'','','习近平给全国各族人民拜年','kfldsafklasjflasd  ad skfjasldsdf af','','asdf asfas','Eva',NULL,'eee@eee.com','13802871875','18639493445',NULL,'5459 Canada Way','Burnaby',NULL,NULL,'','',2,0,0,1,0,1454887042,0),(89,15,2,1,'','','习近平给全国各族人民拜年','kfldsafklasjflasd  ad skfjasldsdf af','','dsfasfsd','Eva',NULL,'eee@eee.com','13802871875','18639493445',NULL,'5459 Canada Way','Burnaby',NULL,NULL,'','',3,0,0,1,0,1454887114,0),(90,15,2,10,'','','中纪委发“廉政红包”提示党员干部春节八事不能做','1.严禁违规用公款吃喝、旅游和参与高消费娱乐健身活动。','','<div class=\"original-tit\">原标题：中纪委发&ldquo;廉政红包&rdquo;提示党员干部春节八事不能做</div>\n\n<div class=\"text clear\" id=\"contentText\">\n<div>\n<p>　　京华时报讯（记者马金凤）日前，中央纪委通过其官网给广大党员干部发出了一封&ldquo;廉政红包&rdquo;，提醒党员干部可不能把纪律和规矩意识忘在九霄云外。春节期间，哪些事情不能做？昨日，中纪委官网给出温馨提醒。</p>\n\n<p>　　中纪委指出，深入落实中央八项规定精神，严格践行廉洁自律各项规定，要持续深入反对&ldquo;四风&rdquo;，着力解决不严不实的问题，深入学习宣传《中国共产 党廉洁自律准则》和《中国共产党纪律处分条例》，教育引导党员干部自觉在廉洁自律上追求高标准，在严守党纪上远离违纪红线。党员领导干部要多带头崇廉拒 腐，树立良好家风，坚决杜绝&ldquo;节日腐败&rdquo;。</p>\n\n<p>　　中纪委提醒党员干部：过节不可过线，绷紧纪律这根弦。</p>\n\n<p>　　&gt;&gt;中纪委提示</p>\n\n<p>　　1.严禁违规用公款吃喝、旅游和参与高消费娱乐健身活动。</p>\n\n<p>　　2.严禁用公款购买赠送贺年卡及烟花爆竹等年货节礼。</p>\n\n<p>　　3.严禁用公款接待走亲访友、外出旅游等非公务活动。</p>\n\n<p>　　4.严禁公车私用或&ldquo;私车公养&rdquo;。</p>\n\n<p>　　5.严禁违规收受礼品、礼金、消费卡等。</p>\n\n<p>　　6.严禁违规出入私人会所。</p>\n\n<p>　　7.严禁违规操办婚丧喜庆事宜并借机敛财。</p>\n\n<p>　　8.严禁违规参加老乡会、校友会、战友会。</p>\n\n<p>　　&gt;&gt;新闻背景</p>\n\n<div class=\"original-tit\">原标题：猴年春晚南北节目更平衡</div>\n\n<div class=\"text clear\" id=\"contentText\">\n<div>\n<div>\n<div><img alt=\"军人出身的侯勇（中）带来节目《将军与士兵》，表演中他需要保持着踢正步的姿势说台词，腿一抬就是好几分钟。作品的最后，三军仪仗队的战士走上舞台。\" src=\"http://photocdn.sohu.com/20160208/Img437106156.jpeg\" />\n<div class=\"conserve-photo\" style=\"top: 644px; left: 871.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n<span style=\"font-size:12px\">　　军人出身的侯勇（中）带来节目《将军与士兵》，表演中他需要保持着踢正步的姿势说台词，腿一抬就是好几分钟。作品的最后，三军仪仗队的战士走上舞台。</span>\n\n<div><img alt=\"TFBOYS与月亮姐姐带来的儿童节目勾起三代人的回忆。\" src=\"http://photocdn.sohu.com/20160208/Img437106157.jpeg\" />\n<div class=\"conserve-photo\" style=\"top: 962px; left: 871.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n\n<div>\n<div><span style=\"font-size:12px\">TFBOYS与月亮姐姐带来的儿童节目勾起三代人的回忆。</span></div>\n</div>\n</div>\n</div>\n</div>\n\n<p>　　中纪委过节&ldquo;打招唿&rdquo;不是第一次</p>\n\n<p>　　据《人民日报》报道，过节之前给党员干部打个招唿、提个醒，这已经是中纪委近年来的规定动作了&mdash;&mdash;2015年9月中秋期间，中纪委就发布过同样的&ldquo;温馨提醒&rdquo;，内容则是&ldquo;十个严禁&rdquo;，刹的就是一些人违规送月饼的歪风。</p>\n\n<p>　　冰冻三尺非一日之寒。作风问题历来具有顽固性、反复性，而节假日更是&ldquo;四风&rdquo;问题的易发多发期。对一些党员干部来说，&ldquo;年关&rdquo;就是&ldquo;廉关&rdquo;，中纪委一再在重要节点狠抓四风，就是提醒党员干部自己绷紧廉洁自律这根弦，哪怕松懈一丝一毫，也是危险的倒退。</p>\n\n<p>　　一年之计在于春。这样的提醒更是在告诉所有党员干部：2016年中纪委执纪监督会更严，党员干部应自觉在廉洁自律上追求高标准。</p>\n</div>\n</div>','Eva','','eee@eee.com','001-3834034234234','sdfasdf','','','',NULL,NULL,'','',7,1,0,1,0,1454887323,1455818904),(91,15,2,12,'','','sdfsdf','sdafsdaf','','<div class=\"original-tit\">原标题：猴年春晚南北节目更平衡</div>\n\n<div class=\"text clear\" id=\"contentText\">\n<div>\n<div>\n<div><img alt=\"军人出身的侯勇（中）带来节目《将军与士兵》，表演中他需要保持着踢正步的姿势说台词，腿一抬就是好几分钟。作品的最后，三军仪仗队的战士走上舞台。\" src=\"http://photocdn.sohu.com/20160208/Img437106156.jpeg\" />\n<div class=\"conserve-photo\" style=\"top: 644px; left: 871.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n<span style=\"font-size:12px\">　　军人出身的侯勇（中）带来节目《将军与士兵》，表演中他需要保持着踢正步的姿势说台词，腿一抬就是好几分钟。作品的最后，三军仪仗队的战士走上舞台。</span>\n\n<div><img alt=\"TFBOYS与月亮姐姐带来的儿童节目勾起三代人的回忆。\" src=\"http://photocdn.sohu.com/20160208/Img437106157.jpeg\" />\n<div class=\"conserve-photo\" style=\"top: 962px; left: 871.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n\n<div>\n<div><span style=\"font-size:12px\">TFBOYS与月亮姐姐带来的儿童节目勾起三代人的回忆。</span></div>\n</div>\n\n<div><img alt=\"杨洋与着名歌唱家佟铁鑫演绎的《父子》成为最催泪节目。\" src=\"http://photocdn.sohu.com/20160208/Img437106158.jpeg\" />\n<div class=\"conserve-photo\" style=\"top: 1254px; left: 871.5px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n\n<div>杨洋与着名歌唱家佟铁鑫演绎的《父子》成为最催泪节目。</div>\n</div>\n\n<p>　　新京报讯 （首席记者刘玮）昨晚8时，一年一度的除夕年夜饭央视春节联欢晚会如期而至。TFBOYS带来的儿童节目《幸福成长》high翻全场，黑猫警长、喜羊羊、 胡巴等卡通人物轮番出场，带动了从70后到00后的共同儿时回忆，这个节目也被认为是春晚关注度最高的一个儿童节目。</p>\n\n<p>　　据春晚总导演吕逸涛介绍，过去5年来的春晚节目基本都是由一个导演组来完成，今年则是打破了这一管理，把一些社会精英力量邀请进来参与春晚重点节目的创作，比如今年的开场节目委托陈维亚来做指导，杂技委托甲丁来做指导，舞蹈节目委托杨东升做指导。</p>\n\n<p>　　谈及春晚南北收视不平衡的情况，吕逸涛此前在接受媒体采访时表示，去年的春晚只有1个南方节目，但是今年为了突出全国人民大联欢，台里特别提出 了不能是北方的春晚，更不能是北京人的春晚，在加大整合的基础上，南方节目增加至5个，包括苏州评弹、西南少数民族歌舞等，希望通过这种调整能使春晚收视 均衡。</p>\n\n<p><strong>　　歌舞类节目推新人</strong></p>\n\n<p>　　央视春晚每年都以&ldquo;推新人&rdquo;为一项重要任务。而说到今年最&ldquo;新&rdquo;的新人，那一定是TFBOYS，他们的节目《幸福成长》中，TFBOYS三只小 将与少儿频道主持人月亮姐姐、红果果和绿泡泡一起表演，并演唱自己的成名曲《青春修炼手册》。这个节目不仅有小朋友喜欢的喜羊羊、灰太狼、熊大熊二等卡通 人物，也有黑猫警长、舒克、贝塔等80后熟悉的动画形象。当&ldquo;黑猫警长&rdquo;的音乐播放出来，现场有不少大人都跟着一起合唱。</p>\n\n<p>　　语言类节目中，修睿搭档娄艺潇，和新人乔杉一起刻画了一个普通且大众的职业&mdash;&mdash;快递员的生活。节目中，一脸络腮胡子的修睿遭乔杉频起外号&ldquo;张 飞、李逵、沙僧、宝玉&rdquo;，这句台词的&ldquo;伏笔&rdquo;是最后乔杉说：&ldquo;我知道宝玉没胡子，就是想给你凑个四大名着。&rdquo;这段对白也被认为&ldquo;很机智&rdquo;。</p>\n\n<p>　　<strong>&ldquo;老人&rdquo;是语言类节目主力</strong></p>\n\n<p>　　实际上，能够在除夕夜看到一些&ldquo;春晚老面孔&rdquo;也是很多观众的一大期待。今年春晚上，潘长江和蔡明的&ldquo;毒舌&rdquo;搭配得以延续，话题则是赶时髦地聊起了网购。</p>\n\n<p>　　而今年春晚上&ldquo;最老&rdquo;的面孔就是冯巩了，今年也是他第31次上春晚，每每以&ldquo;我想死你们了&rdquo;开场的冯巩，今年则和徐帆以及爱徒白凯南同台，出演 小品《快乐老爸》。徐帆扮演了一位跳广场舞的大妈，也是冯巩的毒舌邻居，整个作品围绕邻里矛盾展开，这个小品最大的特点就是网络语言扎堆。值得一提的是， 徐帆更是唱起《最炫民族风》跳起广场舞，又唱又跳，十分热闹。</p>\n\n<p>　<strong>　影视演员跨界抢镜</strong></p>\n\n<p>　　每一年的春晚中都会有一些当红的影视演员来&ldquo;串门&rdquo;，今年也能见到不少大家在荧屏上熟悉的身影。第一个开场的歌舞表演《春到福来》就有闫妮、沙 溢的联手亮相，他们与专业歌手蔡国庆、林依轮等人一同演唱，并串联起这一年发生的大事。尽管《武林外传》已经播出足足十年，但再次看到佟湘玉和白展堂这对 欢喜冤家&ldquo;在一起&rdquo;，还是让人觉得喜气洋洋。</p>\n\n<p>　　如果说去年最红的明星，胡歌肯定算一个。《伪装者》《琅琊榜》让胡歌接连刷屏，人气暴涨，今年胡歌在春晚上的亮相也可以说是&ldquo;众望所归&rdquo;，他在泉州分会场与许茹芸一同演唱了歌曲《相亲相爱》，好听又养眼。</p>\n\n<p>　　梁咏琪、林心如、刘涛，三人在歌舞节目《山水中国美》中一起出现，远处山水映衬的背景搭配高低起伏的舞台设计，再加上上海评弹团和苏州评弹学校奉上的江南风情十足的苏州评弹，《山水中国美》也被看做是当晚视觉效果最美的一个节目。</p>\n\n<p>　　此外，同样也是在这两年走红的&ldquo;小鲜肉&rdquo;杨洋则与着名歌唱家佟铁鑫一同演绎了歌曲《父子》，温情感人。</p>\n\n<p>　　时隔12年再次登上春晚舞台的赵薇则带来了一首《六尺巷》，这首歌则源自于其家乡安徽流传广泛的传统美德故事。这也是赵薇第三次登上春晚舞 台，2000年因电视剧《还珠格格》火遍全国，赵薇第一次登上春晚舞台，当年她身兼嘉宾主持和演唱歌曲等多项任务，2004年，赵薇搭档阿杜演唱《温 暖》，二度登上春晚。</p>\n\n<p>　<strong>　四个分会场同联欢</strong></p>\n\n<p>　　今年春晚在形式上最大的变化就是除了在北京的央视一号大厅录制，同时还走出了演播室，在全国设立了四个分会场。内蒙古唿伦贝尔、陕西西安、广东广州和福建泉州成为四大分会场所在地。</p>\n\n<p>　<strong>　文化谭</strong></p>\n\n<p><strong>　　当我们看春晚小品时 看的是创作者的心思</strong></p>\n\n<p>　　红包这么大，我想去看看。这是走到今年的春晚，打给观众的一针强心剂。而小品，又是历届春晚中最引观众注目的节目。除夕合家团聚的时候，一个有趣的小品，能带给一家人欢声笑语。</p>\n\n<p>　　昨天的小品《放心吧》，想做个好人的孙涛，电话里刚开了句头，对方直接就把他当成骗子了。后来，&ldquo;骗子&rdquo;为了证明自己不是骗子，又被路人当成了 &ldquo;病人&rdquo;。最后在所有人的眼里，活雷锋孙涛，便成了坏人。百口难辩之际，面对老人恨铁不成钢的指责，孙涛苦叹了一句：&ldquo;臣妾做不到啊&rdquo;。</p>\n\n<p>　　这些年，春晚能不能在观众心里站得住，关键看小品能不能撑得住。小品《放心吧》，将人们现实生活中深恶痛绝的电信诈骗，巧妙地展现给了观众，既针砭了时弊，给人们演绎了信任危机的尴尬，又阐述了聪明反被聪明误的道理；既接了地气，又巧妙地传播了正能量。</p>\n\n<p>　　防不胜防的电信诈骗，取材于百姓司空见惯的现实生活。小品中的主人公们，可以是全国随便哪座城市的。按照小品中的年龄，随便穿什么衣服都行。把 可能出现、或者出现过的诈骗经过凑到一起，就是一部黑色幽默剧。剧中角色貌似夸张，实质平实。这表明，小品艺术只要取之于现实生活、敢于针砭社会，并且作 适当的艺术加工，它本身的笑点就已足够。</p>\n\n<p>　　事实证明，高大上，与逗着乐，并不构成绝对的矛盾冲突。小品《放心吧》，它的高大上之处，正是在于敢于揭露现实，直面这个法治的软肋。虽然小品 未能给观众提供面对并解决这个现实问题的根本方案，但它从一个侧面提醒人们，当一个社会彻底丢失了人与人之间的基本信任之后，不仅好人可以变成坏人，自以 为聪明的人也会变成蠢人，健康的正常人也会成为病人。</p>\n\n<p>　　春晚用小品的形式，把这个尴尬的矛盾&ldquo;抛&rdquo;给观众，抛给了道德，其实也是抛给了法治。这时候，你已经无法界定它究竟属于喜剧，还是悲剧，或者正 剧。其实这都不是问题的关键，关键是这部小品，你笑了。苦笑也好，真乐也好，它戳到了中国的现实。这大概也是这个小品，真正用心思的地方吧。</p>\n\n<p>　　刘雪松（媒体人）</p>\n</div>\n</div>','Eva',NULL,'eee@eee.com','001-3834034234234','sdfasdf',NULL,'sdfsdfsd','ddsfsd',NULL,NULL,'','',0,0,0,1,0,1454919020,0),(92,10,2,11,'','','情人节撞车春节后上班首日 白领称虐死情侣情人节撞车春节后上班首日 白领称虐死情侣情人节撞车春节后上班首日 白领称虐死情侣情人节撞车春节后上班首日 白领称虐死情侣','班首日 白领称虐死情侣情人节撞车春节后上班首','','<h2>情人节撞车春节后上班首日，今天你要怎么过？</h2>\n\n<ul>\n	<li>安心上班，下班后去浪漫</li>\n	<li>打算请半天假</li>\n	<li>依旧在放假中</li>\n	<li>无所谓咯</li>\n</ul>\n\n<h2>2.你会花多少钱给&ldquo;另一半&rdquo;买礼物？</h2>\n\n<ul>\n	<li>百元以内</li>\n	<li>500左右</li>\n	<li>超过千元</li>\n</ul>','雪上飞葫',NULL,'bb3343b@bbb.com','604-887-9987','778-988-8989',NULL,'3659 Canada Way','Burnaby',NULL,NULL,'','',26,2,0,1,0,1455415839,1455665434),(93,10,2,8,'','','情人节撞车春节后上班首日 白领称虐死情侣','情人节撞车春节后上班首日 白领称虐死情侣','','<div class=\"original-tit\">原标题：习总书记的青年观：世界与中国的视角</div>\n\n<div class=\"text clear\" id=\"contentText\">\n<div>\n<p>　　&ldquo;十八大&rdquo;以来，习近平总书记通过多种形式、多次寄语青年，对青年寄予了殷切期望。总体上，习总书记的青年观大致包括世界青年观和中国青年观，具体表现在世界与中国的视角。一方面，习总书记的青年观是世界的、全球，另一方面，习总书记的青年观是中国的。</p>\n\n<p>　　一方面，习总书记的青年观是世界的、全球的。他通过世界眼光、全球视野，对中外青年提出殷切希望，并指出青年是国家的未来、民族的未来。他多次发表了&ldquo;青年是未来&rdquo;的重要论述，勉励全球青年共同担当。</p>\n\n<p>　　2013年3月24日，习总书记在俄罗斯莫斯科国际关系学院发表了题为《顺应时代前进潮流 促进世界和平发展》的重要演讲。他指出，青年是国家的未来，是世界的未来，也是中俄友好事业的未来。同时也提到，在座各位同学是俄罗斯青年一代的精英。我 期待着越来越多的中俄青年接过中俄友谊的接力棒，积极投身两国人民友好事业。</p>\n\n<p>　　2013年9月7日，习总书记在哈萨克斯坦纳扎尔巴耶夫大学发表了题为《弘扬人民友谊 共创美好未来》的重要演讲。他指出，青年是民族的未来。看着同学们朝气蓬勃的精神面貌，我不由想起了我的大学时代，那是一个令人难忘的青春记忆。同时也提 到，青年时代是学习知识、陶冶情操、增长本领的黄金时期。青年是人民友谊的生力军。青年人情趣相近、意气相投，最谈得来，最容易结下纯真的友谊。包括在座 各位同学在内的中哈两国青年，一定会成为中哈友谊的使者，为中哈全面战略伙伴关系发展贡献青春和力量。</p>\n\n<p>　　2014年4月1日，习总书记在比利时布鲁日欧洲学院发表重要演讲。他指出，青年最富有朝气、最富有梦想。中国的未来属于年轻一代，欧洲的未来 属于年轻一代，世界的未来属于年轻一代。希望中欧双方的同学们用平等、尊重、爱心来看待这个世界，用欣赏、包容、互鉴的态度来看待世界上的不同文明，促进 中国和欧洲人民的相互了解和理解，促进中国、欧洲同世界其他国家人民的相互了解和理解，用青春的活力和青春的奋斗，让我们生活的这个星球变得更加美好。</p>\n\n<p>　　2014年7月4日，习总书记在韩国国立首尔大学发表了题为《共创中韩合作未来 同襄亚洲振兴繁荣》的演讲。他指出，青年是中韩两国的未来，也是亚洲的未来。青年兴则民族兴，青年强则国家强。安重根义士曾挥毫写下&ldquo;白日莫虚度，青春不 再来&rdquo;的书幅，希望青年人珍惜青春、创造生命辉煌。青年人最富有朝气和梦想，也最容易相互沟通和理解。只有精彩的青春才能留下人生精彩的回忆。希望两国青 年互学互鉴、增进友谊，共当中韩友谊的忠实继承者，争做亚洲振兴的积极参与者。</p>\n\n<p>　　2015年9月23日，习总书记在美国塔科马市林肯中学参观时指出，教育是国家和民族的未来。青少年是人一生中最美好的一段时光。希望同学们珍 惜韶华，脚踏实地，刻苦学习，为将来成就一番事业打好基础。中美同学们要携起手来，推动中美关系走向更美好的明天。他同时也提出，希望两国青少年加强交 流，增进友谊，继续为中美关系这座大厦添砖加瓦。也欢迎大家多到中国走走看看，体验和感知中国，更全面、更深刻地了解中国，认识中国，喜爱中国。</p>\n\n<p>　　2015年10月26日，联合国教科文组织第九届青年论坛在巴黎开幕，习总书记发去贺词，在贺词中指出，青年最富有朝气，最富有梦想，是未来的 领导者和建设者。世界的未来属于年轻一代。全球青年有理想、有担当，人类就有希望，推进人类和平与发展的崇高事业就有源源不断的强大力量。他还提到，青年 的未来，与国家的未来一样，同在远方。中国是一个负责任大国，中国青年同样是可以担当的一代；中国致力于世界和平与发展，中国青年同样应当成为推进人类和 平与发展的强大力量。消除极端贫困、战胜不平等和不公正及遏制气候变化，追求更好的未来，构建人类命运共同体，既是世界各国的一致行动，也是全球青年的共 同担当。</p>\n\n<p>　　可见，习总书记对于全球青年寄予了殷切期望，他在向世界青年进行勉励的同时，不忘对中国青年在承担责任、增强友谊、文化交流等方面的要求与期盼。青年是未来，与国家、民族的未来紧密相连。</p>\n\n<p>　　另一方面，习总书记的青年观是中国的，尤其对中国青年的成长与发展提出期盼，并指出青年兴则国家兴，青年强则国家强。</p>\n\n<p>　　2013年3月17日，习总书记在第十二届全国人大一次会议闭幕会上发表重要讲话，他指出，全国广大青少年，要志存高远，增长知识，锤炼意志，让青春在时代进步中焕发出绚丽的光彩。这是&ldquo;十八大&rdquo;以来，习总书记首次对于我国青年提出的殷切期盼。</p>\n\n<p>　　2013年5月2日，习总书记给北京大学考古文博学院2009级本科团支部全体同学回信，回信中写到，中国梦是国家的梦、民族的梦，也是包括广 大青年在内的每个中国人的梦。&ldquo;得其大者可以兼其小。&rdquo;只有把人生理想融入国家和民族的事业中，才能最终成就一番事业。希望你们珍惜韶华、奋发有为，勇做 走在时代前面的奋进者、开拓者、奉献者，努力使自己成为祖国建设的有用之才、栋梁之材，为实现中国梦奉献智慧和力量。</p>\n\n<p>　　2013年5月4日，习总书记在中国航天科技集团公司同各界优秀青年代表座谈时指出，为实现中华民族伟大复兴的中国梦而奋斗，是中国青年运动的 时代主题。青年最富有朝气、最富有梦想。青年一代有理想、有担当，国家就有前途，民族就有希望，实现我们的发展目标就有源源不断的强大力量。青年兴则国家 兴，青年强则国家强。他对青年提出五点希望：一是广大青年一定要坚定理想信念；二是广大青年一定要练就过硬本领；三是广大青年一定要勇于创新创造；四是广 大青年一定要矢志艰苦奋斗；五是广大青年一定要锤炼高尚品格。</p>\n\n<p>　　2013年6月28日，习总书记在全国组织工作会议上发表重要讲话，他指出，有理想就有人生的精神动力，有信念就能开辟美好未来。中国梦是全国 各族人民的共同理想，也是青年一代应该牢固树立的理想追求。中国特色社会主义是我们党带领人民历经千辛万苦找到的实现中国梦的正确道路，也是当代青年应该 牢固确立的人生信念。</p>\n\n<p>　　2013年12月5日，习总书记给华中农业大学&ldquo;本禹志愿服务队&rdquo;回信，他在回信中指出，青年一代有理想、有担当，国家就有前途，民族就有希 望，实现中华民族伟大复兴就有源源不断的强大力量。希望你们弘扬奉献、友爱、互助、进步的志愿精神，坚持与祖国同行、为人民奉献，以青春梦想、用实际行动 为实现中国梦作出新的更大贡献。</p>\n\n<p>　　2014年5月3日，习总书记给河北保定学院西部支教毕业生群体代表回信，他在回信中指出，同人民一道拼搏、同祖国一道前进，服务人民、奉献祖 国，是当代中国青年的正确方向。希望越来越多的青年人以你们为榜样，到基层和人民中去建功立业，让青春之花绽放在祖国最需要的地方，在实现中国梦的伟大实 践中书写别样精彩的人生。</p>\n\n<p>　　2014年5月4日，习总书记在北京大学师生座谈会上发表重要讲话，他指出，广大青年要树立和培育社会主义核心价值观。要坚持由易到难、由近及 远，努力把核心价值观的要求变成日常的行为准则，进而形成自觉奉行的信念理念。无论什么时候，我们都要坚守在中国大地上形成和发展起来的社会主义核心价值 观，在时代大潮中建功立业，成就自己的宝贵人生。他同时提到，青年要把艰苦环境作为磨炼自己的机遇，把小事当作大事干，一步一个脚印往前走。滴水可以穿 石。只要坚韧不拔、百折不挠，成功就一定在前方等你。</p>\n\n<p>　　2014年8月15日，习总书记在南京看望青奥会中国体育代表团时指出，少年强、青年强则中国强。少年强、青年强是多方面的，既包括思想品德、 学习成绩、创新能力、动手能力，也包括身体健康、体魄强壮、体育精神。希望通过你们在这届青奥会上的精彩表现，带动全国广大青少年都积极投身体育锻炼，既 把学习搞得好好的，又把身体搞得棒棒的，做到德智体美全面发展，将来成为祖国建设的栋梁之材。</p>\n\n<p>　　2014年12月20日，习总书记考察澳门大学横琴校区时指出，同学们正处在人生的黄金时期，不仅要有求学求知的热情，而且要有心系国家、心系 特区的担当，做到知行合一、学以致用，为将来走上社会，投身特区和国家建设做好思想品德、学识修养、能力才干等多方面的储备。希望大家通过学习了解我们民 族和国家的历史，汲取中华民族的精神力量，增强民族自豪感，增强文化自信，增强作为一个中国人的骨气和底气。要大力弘扬爱国主义精神，继承爱国爱澳传统， 自觉增强推进&ldquo;一国两制&rdquo;事业的历史责任感，珍惜青春年少的大好时光，创造有信念、有梦想、有奋斗、有奉献的人生。</p>\n\n<p>　　2015年4月7日，习总书记就传承和发扬青奥会宝贵财富作出</p>\n</div>\n</div>','雪上飞葫',NULL,'bb3343b@bbb.com','604-887-9987','778-988-8989',NULL,'3659 Canada Way','Burnaby',NULL,NULL,'','',11,0,0,1,1,1455418637,0),(94,10,2,8,'','','dfasdf','sdfasdfas','','asdfasdfasd','雪上飞葫','','bb3343b@bbb.com','604-887-9987','778-988-8989','','3659 Canada Way','Burnaby',NULL,NULL,'','',2,0,0,1,0,1455418675,1455665923),(95,10,2,3,'','','外媒：朝鲜女外交官抵华疑来求援 出身不一般','外媒称，朝鲜看上去今天在寻求安理会盟友，将其高级外交官派往莫斯科，可能还要去北京。韩联社报道称，朝鲜一名处理核问题以及朝美关系事务的外交官抵达北京。这名外交官名叫崔善熙(音)，是前总理崔永林的女儿。','','<div class=\"abstract bgB clear\">\n<div class=\"r\"><strong>[提要]</strong>　　外媒称，朝鲜看上去今天在寻求安理会盟友，将其高级外交官派往莫斯科，可能还要去北京。韩联社报道称，朝鲜一名处理核问题以及朝美关系事务的外交官抵达北京。这名外交官名叫崔善熙(音)，是前总理崔永林的女儿。</div>\n</div>\n\n<div class=\"text-pic\">\n<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"tableImg\">\n	<tbody>\n		<tr>\n			<td style=\"text-align:center\"><img alt=\"图为崔善熙。\" src=\"http://photocdn.sohu.com/20160130/Img436390859.jpg\" />\n			<div class=\"conserve-photo\" style=\"top: 852px; left: 916.5px; display: block;\">\n			<div class=\"comCount\">1</div>\n			</div>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\">图为崔善熙。&nbsp;<a class=\"savePicBtn\" href=\"javascript:void(0);\">[保存到相册]</a></td>\n		</tr>\n	</tbody>\n</table>\n</div>\n\n<p><br />\n　　【环球时报综合报道】&ldquo;四面楚歌的朝鲜派遣高级外交官去俄罗斯、中国。&rdquo;<span style=\"color:#3366ff\">法新社29日爆出这样一个消息。报道称，美国正在联合国主导推动对朝鲜核试验进行强力制裁，朝鲜看上去今天在寻求安理会盟友，将其高级外交官派往莫斯科，可能还要去北京。</span>中俄都是拥有否决权的安理会常任理事国，在过去曾帮助缓和对朝鲜挑衅的国际反应。尽管两个国家的战略耐心都因朝鲜核试验到了极限，但都不愿看到拥有核武器的邻国混乱地崩溃。朝鲜官方的中央通讯社报道说，该国副外长朴明国率团29日奔赴俄罗斯，但没给出进一步的细节。</p>\n\n<p>　　<span style=\"color:#3366ff\">同一天，韩联社报道称，多名消息人士说，朝鲜一名处理核问题以及朝美关系事务的外交官抵达北京。这名外交官名叫崔善熙(音)，是前总理崔永林的女儿，也是朝鲜外务省美国局副局长</span>，自1月6日朝鲜核试以来，据悉她是第一个出国的朝鲜重要官员，其任务可能是就国际社会推动联合国决议惩罚平壤一事进行磋商。报道称，崔善熙曾是朝鲜六方会谈代表团副团长，她还负责平壤在核计划问题上重大谈判的翻译。</p>','雪上飞葫',NULL,'bb3343b@bbb.com','604-887-9987','778-988-8989',NULL,'3659 Canada Way','Burnaby',NULL,NULL,'','',40,3,0,1,0,1455481335,0),(96,10,2,11,'','','dfgsg sdgsd','gsdfgsdf','','gsdfgsdfgsd gsd','雪上飞葫','','bb3343b@bbb.com','604-887-9987','778-988-8989','','3659 Canada Way','Burnaby',NULL,NULL,'','',15,0,0,1,0,1455482693,1455738031),(97,10,2,6,'','','奥巴马拉东盟南海对华集体出招 闭门谋划诡计','[提要]　　　美国总统奥巴马15日将在加利福尼亚州南部安纳伯格庄园与东盟十国领导人举行闭门会议，英国广播公司12日分析称，美国正力促东盟在南海问题上“集体行动”。即将卸任的缅甸总统吴登盛13日对外宣布，因需参与国内的政治过渡，不出席此次会议。','','<div class=\"original-tit\">原标题：美国与东盟十国领导举行闭门会 借机 &ldquo;遏制中国&rdquo;</div>\n\n<div class=\"text clear\" id=\"contentText\">\n<div>\n<div class=\"sele-frag\">\n<div class=\"sele-bord top-pager-current\" style=\"width: 231px;\">\n<div class=\"sele-now top-pager-current\" style=\"width: 231px;\">第1页 :奥巴马拉东盟南海对华出招</div>\n</div>\n</div>\n\n<div class=\"abstract bgB clear\">\n<div class=\"r\"><strong>[提要]</strong>　　　美国总统奥巴马15日将在加利福尼亚州南部安纳伯格庄园与东盟十国领导人举行闭门会议，英国广播公司12日分析称，美国正力促东盟在南海问题上&ldquo;集体行动&rdquo;。即将卸任的缅甸总统吴登盛13日对外宣布，因需参与国内的政治过渡，不出席此次会议。</div>\n</div>\n\n<div class=\"text-pic\">\n<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"tableImg\">\n	<tbody>\n		<tr>\n			<td style=\"text-align:center\"><img alt=\"“拉森”号通过渚碧礁附近时，中国的两艘水面舰艇尾随其后。虽然中国舰艇在技术水平上赶不上“拉森”号，但美国舰艇上除了127毫米舰炮和使用反舰模式的“标准”防空导弹外，基本没有反舰能力。这对中国主力水面舰艇造成不了多大伤害。资料图：美国海军拉森号导弹驱逐舰。\" src=\"http://photocdn.sohu.com/20151102/Img424920690.jpg\" />\n			<div class=\"conserve-photo\" style=\"top: 934px; left: 946.5px; display: block;\">\n			<div class=\"comCount\">2</div>\n			</div>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:left\">&nbsp; &nbsp;美国国务卿克里24日开启东亚之行。除了中国，另外两个国家&mdash;&mdash;老挝和柬埔寨都是与华关系密切的友好邻邦。英国路透社称，克里此行是为敦促东盟国家在南海问题上应对中国时团结一致，特别是拉拢今年的东盟轮值主席国老挝。资料图：美国海军拉森号导弹驱逐舰。&nbsp;<a class=\"savePicBtn\" href=\"javascript:void(0);\">[保存到相册]</a></td>\n		</tr>\n	</tbody>\n</table>\n</div>\n\n<p>　　【环球时报驻美国特约记者】<span style=\"color:#3366ff\">美国总统奥巴马15日将在加利福尼亚州南部安纳伯格庄园与东盟十国领导人举行闭门会议，会议内容涉及贸易、海事安全和反恐。</span>虽然白宫高官强调，将南海争端作为会议关键议题并非表明&ldquo;冲着中国&rdquo;，但国际舆论普遍感受到美国遏制中国的冲动。</p>\n\n<p>　　美国国家安全委员会亚洲事务资深主任克莱滕布里克和国务院负责亚太事务的助理国务卿拉塞尔11日在美国国务院外国记者中心的一次吹风会上谈到主 办美国与东盟国家领导人会议的目的。据新加坡《联合早报》13日报道，克莱滕布里克表示，会议&ldquo;体现了我们对亚太地区以及东盟持久的承诺&rdquo;。克莱滕布里克 说，东盟在解决全球性问题上发挥越来越重要的作用。拉塞尔则进一步阐述了东盟对于美国的重要性：&ldquo;增长、稳定与规则&rdquo;。拉塞尔说，这次会议不是关于中国 的，&ldquo;当然，东盟国家领导人的脑子里会想着中国经济放缓可能造成的影响、我们应该如何应对中国在南海的行为等问题。与此同时，我们11个国家中的每一个与 中国都有着极为重要的、多方面的关系。&rdquo;</p>\n\n<p>　　<span style=\"color:#3366ff\">英国广播公司(BBC)12日分析称，尽管白宫一再否认会议目的是组建&ldquo;反华同盟&rdquo;或打造&ldquo;遏华圈&rdquo;，但美国同时正大力推动排除中国的TPP自贸区、力促东盟在南海问题上&ldquo;集体行动&rdquo;。</span>《澳大利亚人报》13日称，奥巴马将借此次会议与&ldquo;夹在华盛顿和北京之间的东盟&rdquo;协调美国在该地区安全和贸易等方面的利益，力争加强与&ldquo;中国家门口&rdquo;国家之间的相互联系。</p>\n</div>\n</div>','雪上飞葫',NULL,'bb3343b@bbb.com','604-887-9987','778-988-8989',NULL,'3659 Canada Way','Burnaby',NULL,NULL,'','',54,0,0,1,0,1455484929,1455671225),(98,10,2,18,'','','极简2015秋冬印花百搭修身大码保暖加绒显瘦弹力小脚打底裤女','交易中请勿使用阿里旺旺以外的聊天工具沟通，不要接收可疑文件和不要点击不明来源的链接，支付前核实好域名和支付详情。淘宝不会以订单有问题，让您提供任何银行卡、密码、手机验证码！遇此情况请终止通话或举报到淘宝网 常见骗术','','<div class=\"item-detail\">\n<div class=\"extra-desc-info\">\n<div class=\"attributes\" id=\"attributes\">\n<ul>\n	<li>鞋制作工艺 : 胶粘工艺</li>\n	<li>上市年份季节 : 2016年春季</li>\n	<li>风格 : 韩版</li>\n	<li>鞋底材质 : 橡胶</li>\n	<li>鞋帮高度 : 高帮</li>\n	<li>闭合方式 : 系带</li>\n	<li>流行元素 : 交叉绑带 链子 松糕跟 防水台</li>\n	<li>颜色分类 : 白色 黑色</li>\n	<li>尺码 : 此款为偏大半码 35 36 37 38 39</li>\n	<li>图案 : 纯色</li>\n	<li>适用对象 : 青年（18-40周岁）</li>\n</ul>\n</div>\n</div>\n\n<div id=\"description\">\n<div class=\"tb-des-content\" id=\"J_DivItemDesc\">\n<table style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td><a name=\"jukeRec_1374894098_end\"></a></td>\n		</tr>\n	</tbody>\n</table>\n\n<p style=\"text-align:center\"><span style=\"color:#ff00ff\"><span style=\"font-size:24.0px\">内增高一直是流行元素，今年也是</span></span></p>\n\n<p style=\"text-align:center\"><span style=\"color:#ff00ff\"><span style=\"font-size:24.0px\">如果您的鞋柜里没有一款这样子的鞋子，那么您就out了哦<img src=\"https://img.alicdn.com/imgextra/i4/110549416/TB2vczCiFXXXXXHXXXXXXXXXXXX_%21%21110549416.gif\" /></span></span></p>\n\n<p style=\"text-align:center\"><span style=\"color:#ff00ff\"><span style=\"font-size:24.0px\">温馨提示：（跟高+内增高）大约8厘米哦</span></span></p>\n\n<table style=\"width:100%\">\n</table>\n\n<p><img src=\"https://img.alicdn.com/imgextra/i4/110549416/TB2Qd2fiFXXXXXSXpXXXXXXXXXX_%21%21110549416.jpg\" /><img src=\"https://img.alicdn.com/imgextra/i3/110549416/TB25THciFXXXXajXpXXXXXXXXXX_%21%21110549416.jpg\" /><img src=\"https://img.alicdn.com/imgextra/i3/110549416/TB2_brBiFXXXXabXXXXXXXXXXXX_%21%21110549416.jpg\" /><img src=\"ht