tb-next\" href=\"javascript:;\"></a></div>\n</div>\n</div>','雪上飞葫','','bb3343b@bbb.com','604-887-9987','778-988-8989','','3659 Canada Way','Burnaby',NULL,NULL,'','',42,0,0,1,0,1455516571,1455734866),(99,10,2,8,'','','怎样操办婚丧喜庆事宜不算违规？中纪委答疑','关于“不能利用职权或职务上的影响操办婚丧喜庆事宜”的规定，建议对婚丧嫁娶、宴请的规模及收送礼金奠仪的金额制定明确标准，还建议执行时尊重少数民族民风民俗，不应“一刀切”。','','<p><strong>怎样操办婚丧喜庆事宜才不算违规？</strong></p>\n\n<p>　　关于&ldquo;不能利用职权或职务上的影响操办婚丧喜庆事宜&rdquo;的规定，建议对婚丧嫁娶、宴请的规模及收送礼金奠仪的金额制定明确标准，还建议执行时尊重少数民族民风民俗，不应&ldquo;一刀切&rdquo;。</p>\n\n<p>　　中央纪委法规室：《中国共产党纪律处分条例》第八十五条是对党员操办婚丧喜庆事宜中违纪行为的处分规定。充分理解本条规定需要注意以下几点：</p>\n\n<p>　　首先，本条是在原《中国共产党纪律处分条例》第八十一条基础上修改而成的，将原条例第八十一条第一款&ldquo;利用职务上的便利&rdquo;修改为&ldquo;利用职权或者 职务上的影响&rdquo;，重在强调，除利用职权以外，利用职务所形成的影响操办婚丧喜庆事宜也是禁止的，以体现全面从严治党要求；对原第二款未作修改。</p>\n\n<p>　　其次，本条对党员操办婚丧喜庆事宜中的三类违纪行为作出了处分规定。</p>\n\n<p>一是利用职权或职务影响操办婚丧喜庆事宜，在社会上造成不良影响的。此类行为无论是否大操大办，也无论是否收送礼金，只要该婚丧喜庆事宜是党员利用 职权或职务影响操办的，如：使用管理服务对象的人力、物力，并且在社会上造成不良影响。二是借操办婚丧喜庆事宜之机敛财的。其主要表现形式是行为人通过较 大规模或者多次请客等形式，在操办婚丧喜庆事宜中收取较大数额礼金。三是在操办婚丧喜庆事宜中，有其他侵犯国家、集体和人民利益行为的。如因操办婚丧喜庆 事宜，干扰和妨碍正常的生产、生活、工作、营业、教学、科研、交通秩序和其他正常秩序的，或者有造成人员伤亡或者其他重大事故的，等等。</p>\n\n<p>　　应当指出，禁止党员利用职权或者职务上的影响操办婚丧喜庆事宜，或借机敛财或者有其他侵犯国家、集体和人民利益的行为，并不是禁止传统民俗。只要注意党员，特别是党员领导干部形象，注意可能在群众中造成的不良影响，搞简朴、正常的婚丧喜庆事宜，一样体现传统民俗。</p>\n\n<div class=\"original-tit\">原标题：国防部回应南海岛礁部署红旗9导弹:多年前就存在</div>\n\n<div class=\"text clear\" id=\"contentText\">\n<div>\n<div><img alt=\"【环球时报报道 记者 郭媛丹】针对美国媒体报道中国在南海西沙群岛的永兴岛上部署了2部8枚红旗-9地空导弹及雷达,17日下午国防部新闻局回应《环球时报》问询时表示,称西沙群岛是中国的固有领土,中国拥有在领土范围内部署防卫设施的正当合法权利,以维护国家领土主权和安全。中国在相关岛礁上的海空防卫部署很多年前就已存在,西方个别媒体的炒作纯属是“中国威胁论”的老调重弹。\" src=\"http://photocdn.sohu.com/20160217/Img437669205.png\" />\n<div class=\"conserve-photo\" style=\"top: 733px; left: 950px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n\n<div><img alt=\"国防部回应南海岛礁部署红旗9导弹:多年前就存在\" src=\"http://photocdn.sohu.com/20160217/Img437669206.png\" />\n<div class=\"conserve-photo\" style=\"top: 1088px; left: 950px; display: block;\">\n<div class=\"comCount\">1</div>\n</div>\n</div>\n\n<p>　　【环球时报报道 记者 郭媛丹】针对美国媒体报道中国在南海西沙群岛的永兴岛上部署了2部8枚红旗-9地空导弹及雷达,17日下午国防部新闻局回应《环球时报》问询时表示,称西 沙群岛是中国的固有领土,中国拥有在领土范围内部署防卫设施的正当合法权利,以维护国家领土主权和安全。中国在相关岛礁上的海空防卫部署很多年前就已存 在,西方个别媒体的炒作纯属是&ldquo;中国威胁论&rdquo;的老调重弹。</p>\n\n<p>　　据美国福克斯新闻2月16日报道,类似红旗-9导弹系统的载具是在过去一周时间内被运送上来的。从2月3日的卫星照片来看,岛上的海滩是空的;而到了2月14日,海滩上已经部署了两个营共八台发射车以及相应的雷达系统。</p>\n\n<p>　　一位美国官员证实了照片的准确性。五角大楼正密切关注事态的发展。美国国防部官员在接受福克斯新闻采访时称:&ldquo;美国将唿吁所有南海问题相关国家停止岛礁建设。&rdquo;</p>\n\n<p>　　一位美国官员表示,这些载具看起来很像红旗-9防空导弹系统&mdash;&mdash;&ldquo;类似于俄罗斯S-300导弹系统&rdquo;。&ldquo;红旗-9射程达125英里,将对接近的任何飞机,不论是民用还是军用的,造成严重威胁。&rdquo;</p>\n\n<p>　　海军军事学术研究所研究员张军社17日接受《环球时报》记者采访时表示,中国自古以来对西沙群岛拥有主权,新中国成立后设立了西沙、南沙、中沙 群岛办事处,并有驻军。西沙群岛没有任何争议,永兴岛就是岛,并不是人工岛,美国在西沙群岛问题上故意混淆是非,挑拨离间。西沙群岛是中国自己领土,部署 防御性武器是理所当然的。</p>\n\n<p>　　各个国家在自己所属的岛屿上部署自己的武器是国际通行做法。比如美国在关岛(关岛是美国托管地)部署了战略轰炸机、核潜艇、军舰,美国没有资格来指责中国。在西沙群岛,从新中国成立后,就部署了各种防御性武器装备,美国将此与南沙群岛联系在一起别有用心</p>\n</div>\n</div>','雪上飞葫','','bb3343b@bbb.com','604-887-9987','778-988-8989','','3659 Canada Way','Burnaby',NULL,NULL,'','',24,6,0,1,0,1455737357,1455738014),(100,10,2,10,'','','Add support LM log new version and new format, if number of comma >=15,   trim the string from 15  to the end','xcxgv fgdfg','','Mine Simulator:Add support LM log new version and new format, if number of comma &gt;=15,&nbsp;&nbsp; trim the string from 15&nbsp; to the end ,&nbsp; save to string2 column. done<br />\nCompile and re-build&nbsp; installation package. done<br />\nUnit test and integration test<br />\n&nbsp;<br />\n&nbsp;<br />\nMTDL\n<ol>\n	<li>BBStreamAdd support LM log new version and new format, if number of comma&nbsp;&nbsp; trim the string from 15&nbsp; to the end ,&nbsp; save to string2 column. done</li>\n</ol>\n&nbsp;\n\n<ol>\n	<li>MMStream\n	<ol style=\"list-style-type:lower-alpha\">\n		<li>AWS Cloud Version:</li>\n	</ol>\n	</li>\n</ol>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;SQL Server&nbsp; new&nbsp; Table :&nbsp;&nbsp;&nbsp; log_mtdl_data;&nbsp; log