image out of boundary ,&nbsp; throw error and stop processing.<br />\n&nbsp;<br />\n&nbsp;','雪上飞葫',NULL,'bb3343b@bbb.com','604-887-9987','778-988-8989',NULL,'3659 Canada Way','Burnaby',NULL,NULL,'','',0,0,0,1,0,1455755504,0),(107,10,2,11,'','','','','','Mine Simulator:\n<ul>\n	<li>Add support LM log new version and new format, if number of comma &gt;=15,&nbsp;&nbsp; trim the string from 15&nbsp; to the end ,&nbsp; save to string2 column. done</li>\n	<li>Compile and re-build&nbsp; installation package. done</li>\n	<li>Unit test and integration test</li>\n</ul>\n&nbsp;<br />\n&nbsp;<br />\nMTDL\n<ol>\n	<li>BBStream</li>\n</ol>\n\n<ul>\n	<li>Add support LM log new version and new format, if number of comma &gt;=15,&nbsp;&nbsp; trim the string from 15&nbsp; to the end ,&nbsp; save to string2 column. done</li>\n	<li>Compile and re-build&nbsp; installation package. done</li>\n	<li>Unit test and integration test</li>\n</ul>\n&nbsp;\n\n<ol>\n	<li>MMStream\n	<ol style=\"list-style-type:lower-alpha\">\n		<li>AWS Cloud Version:</li>\n	</ol>\n	</li>\n</ol>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;\n\n<ul>\n	<li>SQL Server&nbsp; new&nbsp; Table :&nbsp;&nbsp;&nbsp; log_mtdl_data;&nbsp; log_mtdl_teeth done</li>\n	<li>Create new database object to support Critical Event and Dashboard done</li>\n	<li>Constraint , relationship and diagram update done</li>\n	<li>Trigger, Store Procedure,&nbsp; for Critical Event&nbsp; done</li>\n	<li>Trigger, Store Procedure,&nbsp; for Dashboard&nbsp;&nbsp; done</li>\n</ul>\n&nbsp;\n\n<ul>\n	<li>Create new MTDL core library to handle &quot;MTDL&quot; new log. done</li>\n	<li>Create new MTDL c# Entity Framework ,&nbsp; Create&nbsp; table constraint , relationship, trigger, store procedure to c#&nbsp; ORM metadata for database installation. done</li>\n	<li>Create c# business logic for Critical Event and Dashboard: Background worker Message and Dashborad data pushing</li>\n	<li>Create MTDL log process class to integrate components and business logic</li>\n	<li>Unit test and integration test</li>\n</ul>\n&nbsp;<br />\n&nbsp;<br />\n&nbsp;<br />\n&nbsp;<br />\n&nbsp;<br />\n&nbsp;<br />\nTwo new features:<br />\n1) LM new log definition<br />\n2) MTDL add to Mine Simulator<br />\n&nbsp;<br />\n&nbsp;<br />\n2015-12-11<br />\nMine Simulator: &nbsp;not start yet\n<ul>\n	<li>Implement new subsystem MTDL core library&nbsp; to Mine Simulator</li>\n	<li>Add MTDL subsystem to GUI and Report</li>\n	<li>Unit test and integration test</li>\n</ul>\n&nbsp;<br />\n&nbsp;<br />\nMTDL\n<ol>\n	<li>BBStream</li>\n</ol>\n\n<ul>\n	<li>Unit test and integration test not start yet</li>\n</ul>\n&nbsp;\n\n<ol>\n	<li>MMStream\n	<ol style=\"list-style-type:lower-alpha\">\n		<li>AWS Cloud Version:</li>\n	</ol>\n	</li>\n</ol>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;\n\n<ul>\n	<li>Create c# business logic for Critical Event and Dashboard: Background worker Message and Dashborad data pushing done</li>\n	<li>Create MTDL log process class to integrate components and business logic done</li>\n	<li>Unit test and integration test&nbsp; not start yet</li>\n</ul>\n&nbsp;<br />\nLincensing by Equipment for Local and &nbsp;AWS Cloud MMStream Log Processor\n<ol>\n	<li>Add&nbsp;&nbsp; two new columns to two tables &nbsp;done</li>\n	<li>Update MMStream Entity Framework for Local and AWS &nbsp;&nbsp;done</li>\n</ol>\n&nbsp;<br />\nFM Tag on BBStream Log Processor\n<ol>\n	<li>Restore MMI Log Processor Latest database to develop environment&nbsp; done</li>\n	<li>Update the BBStream Linq to SQL database SQLMeta for database&nbsp; creation&nbsp; done</li>\n	<li>Replace old FM core library with PortaMetrics FM core library.</li>\n	<li>Replace old metadata parser and old FM log class with new parser and new log class</li>\n	<li>Replace database layer to support FM Tag feature</li>\n</ol>\n&nbsp;<br />\n&nbsp;<br />\n&nbsp;<br />\n&nbsp;<br />\n&nbsp;<br />\n&nbsp;<br />\n&nbsp;<br />\nTwo new features:<br />\n1) LM new log definition<br />\n2) MTDL add to Mine Simulator<br />\n&nbsp;<br />\n&nbsp;<br />\nWM Log Ver 4&nbsp; issue raised by HaiRong:<br />\n1)&nbsp; All Log Processor (old , BBStream, MMStream can not process).<br />\n2)&nbsp; Unit Test and Debug find out the problem: parse metadata error on WM measurements field<br />\nWM Version 4&nbsp; definition doesn&#39;t match&nbsp; for the comma position:<br />\nFor example :&nbsp;<br />\nmeasurements&nbsp; start from&nbsp; 20&nbsp; in WM Log Ver 4 MetaData<br />\nmeasurements&nbsp; start from&nbsp; 19&nbsp; in Log Processor<br />\nWhich one is correct ?<br />\n&nbsp;<br />\nBBStream Integrate with&nbsp; PortaMetrics FM core library and Tagging core library.<br />\n1)&nbsp; Create unit test and debug information to solve the DLL conflict and VS version conflict.<br />\n2)&nbsp; Create unit test and debug to trace&nbsp; FM core library and Tagging core library not working.<br />\n3)&nbsp; From the debug and output information,&nbsp; FM log can not be processed for the below DLL problem:<br />\n&nbsp;<br />\nError: FM_CORE.Process() error : A generic error occurred in GDI+. -&nbsp;&nbsp;&nbsp; at System.Drawing.Image.Save(String filename, ImageCodecInfo encoder, EncoderParameters encoderParams)<br />\n&nbsp;at MotionMetrics.FM.FM_CORE.Process() in c:\\Demo\\MetricsCoreLib\\FragMetricsCoreLib.cs:line 170<br />\n&nbsp;<br />\nFM&nbsp; core library required&nbsp; &quot;PixelFormat.Format24bppRgb&quot; .&nbsp;<br />\nWe crop image in log processor with &quot;PixelFormat.Format24bppRgb&quot;,&nbsp;&nbsp; it will cause&nbsp; GDI+&nbsp; graphic dll&nbsp; error.&nbsp;&nbsp;<br />\n&nbsp;','雪上飞葫',NULL,'bb3343b@bbb.com','604-887-9987','778-988-8989',NULL,'3659 Canada Way','Burnaby',NULL,NULL,'','',0,0,0,1,0,1455755533,0),(108,18,2,2,'','','中国改革永久居留制度 外国人享公民待遇','中国官媒报道，中共中央办公厅、国务院办公厅印发了《关于加强外国人永久居留服务管理的意见》，对外国人永久居留服务管理制度进行全面改革和创新，明确了永久居留外国人在出入境、就业、购房、办理金融业务、申领驾照、子女入学、交通出行、住宿登记、社会保险等方面的资格待遇。','','<div class=\"row\">\n<h3>中国改革永久居留制度 外国人享公民待遇</h3>\n</div>\n\n<div class=\"row news-mete\">2016-02-20, 09:41 &nbsp;&nbsp;&nbsp;&nbsp;来源: 星洲日报</div>\n\n<div class=\"row news-content responsive-div\">\n<p>中国官媒报道，中共中央办公厅、国务院办公厅印发了《关于加强外国人永久居留服务管理的意见》，对外国人永久居留服务管理制度进行全面改革和创新， 明确了永久居留外国人在出入境、就业、购房、办理金融业务、申领驾照、子女入学、交通出行、住宿登记、社会保险等方面的资格待遇。<br />\n<br />\n　　据公安部有关负责人表示，意见在四方面对外国人永久居留服务管理提出了改革意见。<br />\n<br />\n　 　一是增设外籍高层次人才申请永久居留市场化渠道，进一步便利外籍人才申请永久居留;二是调整各类永久居留申请情形，逐步扩大签发范围;三是全面落实永久 居留资格待遇，建立社会融入机制，提昇永久居留外国人的社会服务水平;四是优化工作流程，完善各项措施，提昇外国人永久居留管理水平。<br />\n<br />\n　 　意见明确指出，永久居留外国人在中国境内工作免办外国人工作许可，可按规定参加技术职务任职资格和职业资格考试;在购房、办理金融业务、申领驾照、子女 入学、交通出行、住宿登记等方面依法享受中国公民同等待遇;在中国境内工作的，依法参加相应社会保险，缴存和使用公积金;在中国境内居住但未工作，且符合 统筹地区规定的，可参照国内城乡居民参加居住地城镇居民基本医疗保险和城乡居民基本养老保险，享受社会保险待遇;在海关通关时，携带的自用物品按照海关规 定办理相关手续。<br />\n<br />\n　　意见还要求有关部门明确本部门职责范围内永久居留外国人享有国民待遇的事项范围，并对外公布和加强落实。</p>\n</div>','Homere',NULL,'hhh@hotmail.com','778-388-3934','',NULL,'中山三路356号华娱大厦','广州',NULL,NULL,'中国教育','中国教育',25,1,0,1,0,1456163774,0),(109,10,2,13,'','','dsf asdfasdf','asdfsad fsadf','','sadfdsaf asf','雪上飞葫',NULL,'bb3343b@bbb.com','604-887-9987','778-988-8989',NULL,'3659 Canada Way','Burnaby',NULL,NULL,'','',0,0,0,1,0,1456170311,0),(110,10,2,8,'','','dsf sadfdsafasd sda fsadf asf sadfsad sdaf sadfsdfds','','','','雪上飞葫',NULL,'bb3343b@bbb.com','604-887-9987','778-988-8989',NULL,'3659 Canada Way','Burnaby',NULL,NULL,'','',1,0,0,1,0,1456171164,0),(111,10,10,14,'','','dsf asdfdsafa','sdfsadfs','','fsad fsdaf','雪上飞葫',NULL,'bb3343b@bbb.com','604-887-9987','778-988-8989',NULL,'3659 Canada Way','Burnaby',NULL,NULL,'','',1,0,0,1,0,1456184386,0),(112,10,2,8,'','','dsf afasfasfasdfsda','','','cxfsdaf asdfsadf sadfsad<br />\nsadjflskdajflksdaj fsdka fjls dafkjlsdja lf<br />\nasdf asdf','雪上飞葫','','bb3343b@bbb.com','604-887-9987','778-988-8989','','3659 Canada Way','Burnaby',NULL,NULL,'','',1,0,0,1,0,1456184939,145618