/*Table structure for table `user_group` */

DROP TABLE IF EXISTS `user_group`;

CREATE TABLE `user_group` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title_en` varchar(64) DEFAULT NULL,
  `desc_en` varchar(256) DEFAULT NULL,
  `title_cn` varchar(64) DEFAULT NULL,
  `desc_cn` varchar(256) DEFAULT NULL,
  `level` int(11) DEFAULT '0',
  `orderno` int(11) DEFAULT '0',
  `status` tinyint(1) DEFAULT '1',
  `deleted` tinyint(1) DEFAULT '0',
  `created_time` bigint(20) DEFAULT '0',
  `last_updated` bigint(20) DEFAULT '0',
  `temp_id` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

/*Data for the table `user_group` */

insert  into `user_group`(`id`,`title_en`,`desc_en`,`title_cn`,`desc_cn`,`level`,`orderno`,`status`,`deleted`,`created_time`,`last_updated`,`temp_id`) values (1,'Personal - Visitor','Visitor','个人 - 一般访客','可以发布个人广告，各种主题的相关信息',14,90,1,0,1450839954,1456274194,0),(2,'Company - Normal User','Oragnization; Company; Coperation; Inc.','公司 - 普通用户','可以发布有关公司和组织的广告和各种主题的相关信息',13,80,1,0,1450840043,1456274431,0),(3,'Personal - Online Store','','个人 - 网上商城','可以发布广告，信息，可以从事个人网上商店。',12,70,1,0,1450916398,1455842622,0),(4,'Company - Online Store','','公司 - 网上商城','可以发布广告，信息，可以从事企业级别的网上商店。',12,60,1,0,1450916481,1455842634,0);

