insert  into `website_content`(`id`,`keyword`,`template`,`subject`,`content`,`status`,`deleted`,`created_time`,`last_updated`,`orderno`,`operator`) values (1,'home','index.php','home webpage','<div class=\"abstract bgB clear\">\n<div class=\"r\">　&ldquo;由敘利亞人民決定。&rdquo;美國國務卿克裏15日訪問俄羅斯時，在敘利亞總統的去留問題上表態，與俄羅斯的主張達成一致。克裏認為，與普京的會談取得重大成果。不過，俄官方認為，俄美&ldquo;仍然存在嚴重分歧&rdquo;。被問及關於&ldquo;孤立俄羅斯&rdquo;的問題，克裏表示沒有必要。</div>\n</div>\n\n<div class=\"text-pic\">\n<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"tableImg\">\n	<tbody>\n		<tr>\n			<td style=\"text-align:center\">\n			<div style=\"text-align: left;\"><img alt=\"據法新社16日報道，15日晚，克裏與普京舉行了2個多小時的會談，比預定時間延長了一倍。普京在會談結束後表示，“我們共同為解決最棘手的危機進行的努力是有目共睹的”。克裏也表示，對到目前為止兩國所進行的努力感到滿意。資料圖：俄總統普京會見美國國務卿克裏。\" src=\"http://photocdn.sohu.com/20151217/Img431575723.jpg\" /></div>\n\n			<div class=\"conserve-photo\" style=\"top: 921px; left: 946.5px; display: block;\">\n			<div class=\"comCount\" style=\"text-align: left;\">1</div>\n			</div>\n			</td>\n		</tr>\n		<tr>\n			<td>&nbsp; &nbsp;據法新社16日報道，15日晚，克裏與普京舉行了2個多小時的會談，比預定時間延長了一倍。普京在會談結束後表示，&ldquo;我們共同為解決最棘手的危機進行的努力是有目共睹的&rdquo;。克裏也表示，對到目前為止兩國所進行的努力感到滿意。資料圖：俄總統普京會見美國國務卿克裏。&nbsp;<a class=\"savePicBtn\" href=\"javascript:void(0);\">[保存到相冊]</a></td>\n		</tr>\n	</tbody>\n</table>\n</div>\n\n<p>　　【環球時報駐美國特約記者】&ldquo;由敘利亞人民決定。&rdquo;<span style=\"color:#3366ff\">美國國務卿克裏15日訪問俄羅斯時，在敘利亞總統巴沙爾&middot;阿薩德的去留問題上如此表態，與俄羅斯的主張達成一致。</span>克裏認為，與俄總統普京的會談取得重大成果。不過，俄官方認為，俄&nbsp; 美兩國之間在解決敘利亞問題上&ldquo;仍然存在嚴重分歧&rdquo;。</p>\n\n<div class=\"video\">\n<div class=\"text-video-focus\">&nbsp;</div>\n\n<div class=\"num-share\">\n<div class=\"btn-num\"><a class=\"vbtn-ding\" href=\"javascript:void(0)\">1</a><a class=\"vbtn-cai\" href=\"javascript:void(0)\"><em>0</em></a></div>\n\n<div class=\"vbtn-fa\">\n<ul>\n	<li>&nbsp;</li>\n	<li>&nbsp;</li>\n	<li>&nbsp;</li>\n	<li>&nbsp;</li>\n</ul>\n</div>\n</div>\n</div>\n\n<p>　　據法新社16日報道，15日晚，克裏與普京舉行了2個多小時的會談，比預定時間延長了一倍。普京在會談結束後表示，&ldquo;我們共同為解決最棘手的危 機進行的努力是有目共睹的&rdquo;。克裏也表示，對到目前為止兩國所進行的努力感到滿意，&ldquo;我們在敘利亞問題上的看法本質上很相似&rdquo;，如果美俄合作，&ldquo;敘利亞問 題將明顯不同&rdquo;。克裏稱，雙方同意在敘利亞實施停火的原則，並希望能盡快加以落實。</p>\n\n<p>　　據美國廣播公司(ABC)報道，雖然雙方沒有達成最終協議，但在結束敘利亞內戰問題上，克裏接受了俄羅斯的主張，即巴沙爾的命運由敘利亞人民來 決定。&ldquo;美國及其夥伴不尋求所謂的政權更迭。&rdquo;克裏稱，&ldquo;沒人應被迫從獨裁者和受恐怖分子困擾之間做出選擇。&rdquo; 過去數月裏，美國對巴沙爾政策的轉變，原因在於&ldquo;伊斯蘭國&rdquo;(IS)在中東的影響力與日俱增。克裏認為，當前問題的焦點已並非是&ldquo;巴沙爾的去留問題&rdquo;，而 是促進敘利亞和平進程，&ldquo;讓敘利亞人民決定敘利亞的未來&rdquo;。據美聯社16日報道，西方一直以來指責巴沙爾大規模侵犯人權和使用化學武器，並要求其下台。美 國官員還不斷批評俄羅斯幹涉敘利亞目的是支持巴沙爾政權，而非打擊IS。針對克裏此次在巴沙爾問題上的表態，英國廣播公司認為，這是因為美國知道，要想把 巴沙爾拉上談判桌，莫斯科&ldquo;不可或缺&rdquo;</p>',1,0,1450330785,1450378598,0,0),(2,'contact us','contactus','联系我们','<div class=\"original-tit\">原标题：外交部：中方强烈反对美国宣布向台湾出售武器， 自我强大，压倒敌人<br />\n<br />\n<img alt=\"\" src=\"data:image/jpeg;base64,\" style=\"height:224px; margin:0px; width:336px\" /><br />\ndfkdsjfls kasjkdlfsd<br />\n<br />\n<br />\n　　新华网北京12月17日电 12月16日，美国政府宣布向台湾出售总额约18.3亿美元的武器装备。当天，外交部副部长郑泽光奉命召见美国驻华使馆临时代办李凯安，向美方提出严正交涉。</div>\n\n<div class=\"text clear\" id=\"contentText\">\n<div>\n<p>　　郑泽光指出，台湾是中国领土不可分割的一部分。中方坚决反对美国向台湾出售武器。美方向台湾出售武器严重违反国际法和国际关系基本准则，严重违 反中美三个联合公报原则，严重损害中国主权和安全利益。为了维护国家利益，中方决定采取必要措施，包括对参与此次美方向台湾出售武器的企业实施制裁。</p>\n\n<p>　　郑泽光强调，任何人都不能动摇中国政府和人民捍卫国家主权和领土完整、反对外来干涉的坚定意志。中方敦促美方恪守在中美三个联合公报中作出的明确承诺，撤销上述售台武器计划，停止美台军事联系，以免给中美关系和双方重要领域的合作造成进一步损害。</p>\n</div>\n</div>',1,0,1450331000,1450553448,0,0),(3,'fsadfs','adfsdaf','safsdfasdfsadf','sfsadf afasdfas fsadfsdfsdafsd f<br />\n<br />\nADJKLajdl;a<br />\naKLDJSALK D<br />\ndkjaldadad DA<img alt=\"\" src=\"data:image/jpeg;base64,\" style=\"height:267px; margin-bottom:0px; margin-left:0px; margin-right:0px; margin-top:0px; width:400px\" /><br />\n<br />\nASDJFLKASJFLASDFASD',1,0,1450553536,0,0,0);

/*Table structure for table `website_country` */

DROP TABLE IF EXISTS `website_country`;

CREATE TABLE `website_country` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `country_en` varchar(64) DEFAULT NULL,
  `country_cn` varchar(64) DEFAULT NULL,
  `currency_en` varchar(16) DEFAULT NULL,
  `currency_cn` varchar(16) DEFAULT NULL,
  `symbol` varchar(16) DEFAULT NULL,
  `orderno` int(11) DEFAULT '0',
  `status` tinyint(1) DEFAULT '1',
  `deleted` tinyint(1) DEFAULT '0',
  `created_time` bigint(20) DEFAULT '0',
  `last_updated` bigint(20) DEFAULT '0',
  `operator` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

/*Data for the table `website_country` */

