DROP TABLE IF EXISTS `website_hits`;

CREATE TABLE `website_hits` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `filter` varchar(16) DEFAULT NULL,
  `template` varchar(64) DEFAULT NULL,
  `url` varchar(256) DEFAULT NULL,
  `platform` varchar(64) DEFAULT NULL,
  `browser` varchar(64) DEFAULT NULL,
  `version` varchar(64) DEFAULT NULL,
  `ip_address` varchar(64) DEFAULT NULL,
  `webpage` varchar(64) DEFAULT NULL,
  `info` varchar(256) DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `deleted` tinyint(1) DEFAULT '0',
  `created_time` bigint(20) DEFAULT '0',
  `last_updated` bigint(20) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6967 DEFAULT CHARSET=utf8;

