/*Table structure for table `website_language` */

DROP TABLE IF EXISTS `website_language`;

CREATE TABLE `website_language` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `project` varchar(64) DEFAULT NULL,
  `filter` varchar(64) DEFAULT NULL,
  `keyword` varchar(256) DEFAULT NULL,
  `cn` varchar(1024) DEFAULT NULL,
  `en` varchar(1024) DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `deleted` tinyint(1) DEFAULT '0',
  `created_time` bigint(20) DEFAULT '0',
  `last_updated` bigint(20) DEFAULT '0',
  `operator` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
